    "\n            Forgot your Twitter password?\u003Cbr/\u003E\n                    \u003Cspan style=\"color: #63839a;\"\u003E\u003Cstrong\u003EGet\n                      instructions on how to reset it \u0026raquo;\u003C/strong\u003E\u003C/span\u003E\n            ": "\u5fd8\u8bb0\u4e86\u4f60\u7684 Twitter \u5bc6\u7801?\u003Cbr/\u003E \u003Cspan style=\"color: #63839a;\"\u003E\u003Cstrong\u003E\u83b7\u53d6\u5982\u4f55\u91cd\u7f6e\u5bc6\u7801\u7684\u5e2e\u52a9\u003C/strong\u003E\u003C/span\u003E",
