    "\u003Ctd\u003E\u003Cb\u003E@\u003C/b\u003Emashable\u003C/td\u003E\u003Ctd\u003Ereferencing person \"mashable\".\u003C/td\u003E": "\u003Ctd\u003E\u003Cb\u003E@\u003C/b\u003Emashable\u003C/td\u003E\u003Ctd\u003E\u5f15\u7528\u7528\u6237\u201cmashable\u201d\u3002\u003C/td\u003E",
    "\u003Ctd\u003E\u003Cb\u003Efrom:\u003C/b\u003Ealexiskold\u003C/td\u003E\u003Ctd\u003Esent from person \"alexiskold\".\u003C/td\u003E": "\u003Ctd\u003E\u003Cb\u003Efrom:\u003C/b\u003Ealexiskold\u003C/td\u003E\u003Ctd\u003E\u53d1\u81ea\u7528\u6237\u201calexiskold\u201d\u3002\u003C/td\u003E",
    "\u003Ctd\u003E\u003Cb\u003Enear:\u003C/b\u003ENYC \u003Cb\u003Ewithin:\u003C/b\u003E15mi\u003C/td\u003E\u003Ctd\u003Esent within 15 miles of \"NYC\".\u003C/td\u003E": "\u003Ctd\u003E\u003Cb\u003Enear:\u003C/b\u003E\u7ebd\u7ea6 \u003Cb\u003Ewithin:\u003C/b\u003E15mi\u003C/td\u003E\u003Ctd\u003E\u5728\u7ebd\u7ea6\u65b9\u570615\u82f1\u91cc\u4ee5\u5185\u53d1\u9001\u7684\u3002\u003C/td\u003E",
    "\u003Ctd\u003E\u003Cb\u003Eto:\u003C/b\u003Etechcrunch\u003C/td\u003E\u003Ctd\u003Esent to person \"techcrunch\".\u003C/td\u003E": "\u003Ctd\u003E\u003Cb\u003Eto:\u003C/b\u003Etechcrunch\u003C/td\u003E\u003Ctd\u003E\u53d1\u9001\u7ed9\u7528\u6237\u201ctechcrunch\u201d\u3002\u003C/td\u003E",
    "\u003Ctd\u003Ebeer \u003Cb\u003E-\u003C/b\u003Eroot\u003C/td\u003E\u003Ctd\u003Econtaining \"beer\" but not \"root\".\u003C/td\u003E": "\u003Ctd\u003E\u9ebb\u5a46 \u003Cb\u003E-\u003C/b\u003E\u8c46\u8150\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\u201c\u9ebb\u5a46\u201d\u4f46\u4e0d\u542b\u201c\u8c46\u8150\u201d\u3002\u003C/td\u003E",
    "\u003Ctd\u003Eflight \u003Cb\u003E:(\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003Econtaining \"flight\" and with a negative attitude.\u003C/td\u003E": "\u003Ctd\u003E\u822a\u73ed \u003Cb\u003E:(\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\u201c\u822a\u73ed\u201d\u4e14\u6d88\u6781\u3002\u003C/td\u003E",
    "\u003Ctd\u003Eftw \u003Cb\u003Euntil:\u003C/b\u003E2010-12-27\u003C/td\u003E\u003Ctd\u003Econtaining \"ftw\" and sent up to date \"2010-12-27\".\u003C/td\u003E": "\u003Ctd\u003E\u8db3\u7403 \u003Cb\u003Euntil:\u003C/b\u003E2010-12-27\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\u201c\u8db3\u7403\u201d\u4e14\u53d1\u9001\u65f6\u95f4\u65e9\u4e8e\u65e5\u671f\u201c2010-12-27\u201d\u3002\u003C/td\u003E",
    "\u003Ctd\u003Ehilarious \u003Cb\u003Efilter:links\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003Econtaining \"hilarious\" and linking to URLs.\u003C/td\u003E": "\u003Ctd\u003E\u641e\u7b11 \u003Cb\u003Efilter:links\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\u201c\u641e\u7b11\u201d\u4e14\u5e26\u6709\u94fe\u63a5\u3002\u003C/td\u003E",
    "\u003Ctd\u003Elove \u003Cb\u003EOR\u003C/b\u003E hate\u003C/td\u003E\u003Ctd\u003Econtaining either \"love\" or \"hate\" (or both).\u003C/td\u003E": "\u003Ctd\u003E\u7231 \u003Cb\u003EOR\u003C/b\u003E \u6068\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\"\u7231\"\u6216\u201c\u6068\u201d(\u6216\u4e24\u8005\u90fd\u6709)\u3002\u003C/td\u003E",
    "\u003Ctd\u003Emovie -scary \u003Cb\u003E:)\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003Econtaining \"movie\", but not \"scary\", and with a positive attitude.\u003C/td\u003E": "\u003Ctd\u003E\u7535\u5f71 -\u6050\u6016 \u003Cb\u003E:)\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\u201c\u7535\u5f71\u201d\u4f46\u4e0d\u5305\u542b\u201c\u6050\u6016\u201d,\u4e14\u79ef\u6781\u3002\u003C/td\u003E",
