    "\u003Ctd\u003Esuperhero \u003Cb\u003Esince:\u003C/b\u003E2010-12-27\u003C/td\u003E\u003Ctd\u003Econtaining \"superhero\" and sent since date \"2010-12-27\" (year-month-day).\u003C/td\u003E": "\u003Ctd\u003E\u8d85\u7ea7\u82f1\u96c4 \u003Cb\u003Esince:\u003C/b\u003E2010-12-27\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\u201c\u8d85\u7ea7\u82f1\u96c4\u201d\u4e14\u53d1\u9001\u65f6\u95f4\u665a\u4e8e\u65e5\u671f\u201c2010-12-27\u201d (\u5e74-\u6708-\u65e5)\u3002\u003C/td\u003E",
    "\u003Ctd\u003Etraffic \u003Cb\u003E?\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003Econtaining \"traffic\" and asking a question.\u003C/td\u003E": "\u003Ctd\u003E\u4ea4\u901a \u003Cb\u003E?\u003C/b\u003E\u003C/td\u003E\u003Ctd\u003E\u5305\u542b\u201c\u4ea4\u901a\u201d\u7684\u63d0\u95ee\u3002\u003C/td\u003E",
