    "After completing this step, sign in on this page using your new Twitter credentials.": "\u5b8c\u6210\u6b64\u6b65\u540e\uff0c\u901a\u8fc7\u4f60\u7684\u65b0 Twitter \u5bc6\u7801\u767b\u5f55\u6b64\u9875\u9762\u3002",
    "After you enter your password, Twitter will send a code to your phone that you'll need to access your account. You can \u003Ca href=\"/settings/applications\"\u003Egenerate a temporary password\u003C/a\u003E to log in to other devices and apps that require Twitter credentials.": "\u8f93\u5165\u5bc6\u7801\u540e Twitter \u5c06\u53d1\u9001\u8bbf\u95ee\u8d26\u53f7\u6240\u9700\u7684\u9a8c\u8bc1\u7801\u5230\u4f60\u7684\u624b\u673a\u4e0a\u3002\u4f60\u53ef\u4ee5\u003Ca href=\"/settings/applications\"\u003E\u751f\u6210\u4e00\u4e2a\u4e34\u65f6\u5bc6\u7801\u003C/a\u003E\u4ee5\u767b\u5f55\u5230\u5176\u4ed6\u9700\u8981 Twitter \u6388\u6743\u7684\u8bbe\u5907\u548c\u5e94\u7528\u7a0b\u5e8f\u3002",
    "After you enter your password, Twitter will send a code to your phone that you'll need to access your account. You can \u003Ca href=\"/settings/applications\"\u003Egenerate a temporary password\u003C/a\u003E to log in to other devices and apps that require Twitter credentials. \u003Ca href=\"https://support.twitter.com\"\u003ELearn more\u003C/a\u003E": "\u8f93\u5165\u5bc6\u7801\u540e Twitter \u5c06\u53d1\u9001\u8bbf\u95ee\u8d26\u53f7\u6240\u9700\u7684\u9a8c\u8bc1\u7801\u5230\u4f60\u7684\u624b\u673a\u4e0a\u3002\u4f60\u53ef\u4ee5\u003Ca href=\"/settings/applications\"\u003E\u751f\u6210\u4e00\u4e2a\u4e34\u65f6\u5bc6\u7801\u003C/a\u003E\u4ee5\u767b\u5f55\u5230\u5176\u4ed6\u9700\u8981 Twitter \u6388\u6743\u7684\u8bbe\u5907\u548c\u5e94\u7528\u7a0b\u5e8f\u3002\u003Ca href=\"https://support.twitter.com\"\u003E\u4e86\u89e3\u66f4\u591a\u003C/a\u003E",
    "After you enter your password, Twitter will send a code to your phone that you'll need to access your account. You'll need to \u003Ca href=\"/settings/applications\"\u003Egenerate an application password\u003C/a\u003E to log in to other devices and apps that require Twitter credentials. \u003Ca href=\"https://support.twitter.com\"\u003ELearn more\u003C/a\u003E": "\u8f93\u5165\u5bc6\u7801\u540e Twitter \u5c06\u53d1\u9001\u8bbf\u95ee\u8d26\u53f7\u6240\u9700\u7684\u9a8c\u8bc1\u7801\u5230\u4f60\u7684\u624b\u673a\u4e0a\u3002\u4f60\u9700\u8981\u003Ca href=\"/settings/applications\"\u003E\u751f\u6210\u4e00\u4e2a\u5e94\u7528\u5bc6\u7801\u003C/a\u003E\u4ee5\u767b\u5f55\u5230\u5176\u4ed6\u9700\u8981 Twitter \u6388\u6743\u7684\u8bbe\u5907\u548c\u5e94\u7528\u7a0b\u5e8f\u3002\u003Ca href=\"https://support.twitter.com\"\u003E\u4e86\u89e3\u66f4\u591a\u003C/a\u003E",
    "After you sign in, Twitter will send a SMS message with a code that you'll need to access your account.": "\u767b\u5f55\u540e\uff0cTwitter \u5c06\u53d1\u9001\u4f60\u8bbf\u95ee\u8d26\u53f7\u6240\u9700\u7684\u4ee3\u7801\u77ed\u4fe1\u3002",
    "After you sign in, Twitter will send a code to your phone that you'll need to access your account.": "\u767b\u5f55\u540e\uff0cTwitter \u5c06\u5411\u4f60\u7684\u624b\u673a\u53d1\u9001\u8bbf\u95ee\u8d26\u53f7\u9700\u8981\u7684\u4ee3\u7801\u3002",
    "After you sign in, Twitter will send a code to your phone that you'll need to access your account. Once activated, you will need to \u003Ca href=\"/settings/applications\"\u003Egenerate a temporary password\u003C/a\u003E to sign in to your Twitter account on other devices and apps.": "\u767b\u5f55\u540e\uff0cTwitter \u5c06\u53d1\u9001\u9a8c\u8bc1\u7801\u5230\u4f60\u7684\u624b\u673a\u4e0a\uff0c\u4ee5\u63d0\u4f9b\u8d26\u53f7\u6743\u9650\u3002\u6fc0\u6d3b\u540e\uff0c\u4f60\u9700\u8981\u003Ca href=\"/settings/applications\"\u003E\u751f\u6210\u4e00\u4e2a\u4e34\u65f6\u5bc6\u7801\u003C/a\u003E\u4ee5\u5728\u5176\u4ed6\u8bbe\u5907\u548c\u5e94\u7528\u4e0a\u767b\u5f55\u4f60\u7684 Twitter \u8d26\u53f7\u3002",
    "After you sign in, Twitter will send a code to your phone that you'll need to access your account. Once activated, you will need to \u003Ca href=\"/settings/applications\"\u003Egenerate a temporary password\u003C/a\u003E to sign in to your Twitter account on other devices and apps. \u003Ca href=\"https://support.twitter.com\"\u003ELearn more\u003C/a\u003E": "\u767b\u5f55\u540e Twitter \u5c06\u53d1\u9001\u8bbf\u95ee\u8d26\u53f7\u6240\u9700\u7684\u9a8c\u8bc1\u7801\u5230\u4f60\u7684\u624b\u673a\u4e0a\u3002\u542f\u7528\u540e\u4f60\u9700\u8981\u003Ca href=\"/settings/applications\"\u003E\u751f\u6210\u4e00\u4e2a\u4e34\u65f6\u5bc6\u7801\u003C/a\u003E\u4ee5\u767b\u5f55\u5230\u5176\u4ed6\u9700\u8981 Twitter \u6388\u6743\u7684\u8bbe\u5907\u548c\u5e94\u7528\u7a0b\u5e8f\u3002\u003Ca href=\"https://support.twitter.com\"\u003E\u4e86\u89e3\u66f4\u591a\u003C/a\u003E",
    "After you\u2019ve signed up, the site walks you through a couple of screens to help you find people on Twitter you know or might be interested in. The process is quick, but if you want to jump directly to your account page, just head to the bottom of each page and click \u201cSkip this step.\u201d": "\u4f60\u6ce8\u518c\u4e4b\u540e,\u7f51\u7ad9\u4f1a\u5e26\u4f60\u8d70\u8fc7\u51e0\u4e2a\u5411\u5bfc\u9875\u9762,\u5e2e\u52a9\u4f60\u5728 Twitter \u627e\u5230\u4f60\u8ba4\u8bc6\u7684\u6216\u8005\u53ef\u80fd\u4f1a\u611f\u5174\u8da3\u7684\u4eba\u3002\u8fd9\u4e2a\u8fc7\u7a0b\u5f88\u5feb,\u4f46\u662f\u5982\u679c\u4f60\u60f3\u76f4\u63a5\u8df3\u5230\u4f60\u7684\u8d26\u53f7\u9875\u9762,\u76f4\u63a5\u5230\u5c4f\u5e55\u6700\u4e0b\u65b9\u6309\u201c\u8df3\u8fc7\u8fd9\u4e00\u6b65\u201d\u5373\u53ef\u3002",
