    "Are you sure you want to delete this Widget? Deleting the Widget will also remove it from your website.": "\u786e\u5b9a\u8981\u5220\u9664\u8fd9\u4e2a\u5c0f\u5de5\u5177\u5417? \u5220\u9664\u5c0f\u5de5\u5177\u4e5f\u4f1a\u5bfc\u81f4\u5b83\u4ece\u4f60\u7684\u7f51\u7ad9\u79fb\u9664\u3002",
