    "Are you sure you want to remove your contacts? Who To Follow suggestions may become less relevant.": "\u786e\u5b9a\u8981\u79fb\u9664\u4f60\u7684\u8054\u7cfb\u4eba? \u8fd9\u6837\u53ef\u80fd\u5bfc\u81f4\u63a8\u8350\u5173\u6ce8\u7528\u6237\u4e0e\u4f60\u7684\u76f8\u5173\u6027\u4e0b\u964d\u3002",
    "Are you sure you want to report \u003Ca href=\"/%{person}\"\u003E%{person}\u003C/a\u003E as spammer?": "\u786e\u5b9a\u8981\u62a5\u544a \u003Ca href=\"/%{person}\"\u003E%{person}\u003C/a\u003E \u53d1\u9001\u5783\u573e\u4fe1\u606f?",
    "Are you sure you want to report \u003Ca href=\"/{{screen_name}}\"\u003E@{{screen_name}}\u003C/a\u003E as a spammer?": "\u786e\u5b9a\u8981\u62a5\u544a \u003Ca href=\"/{{screen_name}}\"\u003E@{{screen_name}}\u003C/a\u003E \u53d1\u9001\u5783\u573e\u4fe1\u606f\u5417?",
    "Are you sure you want to reset your consumer key and consumer secret?": "\u786e\u5b9a\u8981\u5220\u9664\u4f60\u7684 Consumer Key \u548c Consumer Secret?",
    "Are you sure you want to revoke access from %{contributor_screen_name}?": "\u786e\u5b9a\u8981\u53d6\u6d88 %{contributor_screen_name} \u7684\u8bbf\u95ee\u6743\u5417?",
    "Are you sure you want to send a Twitter Alert to your followers?": "\u786e\u5b9a\u8981\u53d1\u9001\u4e00\u6761 Twitter \u8b66\u62a5\u7ed9\u4f60\u7684\u5173\u6ce8\u8005\u5417?",
    "Are you sure?": "\u4f60\u786e\u5b9a\u5417?",
    "Aren't you curious to know \u003Ca href=\"{{ADDITIONAL_LOGIN_LINK}}\"\n                                                                  style=\"color: #5a7b93; text-decoration: none;\"\u003Ewhat\n          you're missing on Twitter right now?\u003C/a\u003E": "\u4f60\u96be\u9053\u4e0d\u60f3\u4e86\u89e3\u003Ca href=\"{{ADDITIONAL_LOGIN_LINK}}\" style=\"color: #5a7b93; text-decoration: none;\"\u003E\u4f60\u73b0\u5728\u6b63\u5728 Twitter \u9519\u8fc7\u4ec0\u4e48\u5417?\u003C/a\u003E",
