    "Be tricky! Your password should be at least 6 characters and not a dictionary word or common name. Please use a password that you don't use anywhere else and change your password on occasion.": "\u590d\u6742\u4e9b! \u4f60\u7684\u5bc6\u7801\u5e94\u81f3\u5c11\u5305\u542b6\u4e2a\u5b57\u7b26\u4e14\u4e0d\u662f\u5b57\u5178\u91cc\u6709\u7684\u5355\u8bcd\u6216\u8005\u5e38\u89c1\u7684\u540d\u5b57\u3002\u8bf7\u4e0d\u8981\u548c\u5176\u5b83\u670d\u52a1\u5171\u7528\u5bc6\u7801\u5e76\u6ce8\u610f\u7ecf\u5e38\u66f4\u6362\u5bc6\u7801\u3002",
    "Beauty": "\u7f8e\u5bb9",
    "Because this account includes content that is only appropriate for users of a certain age, we require you to verify your age before accessing this account.  In order to perform this function we may use third-party service providers to collect your information, including your birthdate; however, such service providers can only use your information to the extent necessary for them to provide this service pursuant to our instructions, and only subject to obligations mirroring the protections of our privacy policy located at \u003Ca href=\"http://twitter.com/privacy\" target=\"_new\"\u003Ehttp://twitter.com/privacy\u003C/a\u003E.  We may also share aggregate or anonymous age data with third parties for marketing purposes in accordance with our privacy policy.  For example, we may identify the number of users within an age range that follow a specific account or types of accounts.  By submitting your age information you agree to the sharing of your information as described above.": "\u56e0\u4e3a\u6b64\u8d26\u53f7\u5305\u542b\u7684\u5185\u5bb9\u53ea\u9002\u5408\u7279\u5b9a\u5e74\u9f84\u7684\u7528\u6237,\u6211\u4eec\u9700\u8981\u4f60\u5728\u8bbf\u95ee\u6b64\u8d26\u6237\u4e4b\u524d\u9a8c\u8bc1\u4f60\u7684\u5e74\u9f84\u3002\u4e3a\u4e86\u5b9e\u73b0\u8fd9\u9879\u529f\u80fd\u6211\u4eec\u53ef\u80fd\u4f1a\u5229\u7528\u7b2c\u4e09\u65b9\u670d\u52a1\u63d0\u4f9b\u5546\u6536\u96c6\u4f60\u7684\u4fe1\u606f,\u5305\u62ec\u4f60\u7684\u51fa\u751f\u65e5\u671f;\u4f46\u662f\u8fd9\u6837\u7684\u670d\u52a1\u63d0\u4f9b\u5546\u53ea\u4f1a\u5728\u5fc5\u8981\u60c5\u51b5\u4e0b\u6839\u636e\u6211\u4eec\u7684\u8981\u6c42\u5229\u7528\u4f60\u7684\u4fe1\u606f\u63d0\u4f9b\u6b64\u670d\u52a1,\u5e76\u4e14\u9075\u5b88\u6211\u4eec\u4f4d\u4e8e \u003Ca href=\"http://twitter.com/privacy\" target=\"_new\"\u003Ehttp://twitter.com/privacy\u003C/a\u003E \u7684\u9690\u79c1\u6743\u653f\u7b56\u4e2d\u5173\u4e8e\u4fdd\u62a4\u4e2a\u4eba\u9690\u79c1\u7684\u5185\u5bb9\u3002\u6211\u4eec\u4e5f\u53ef\u80fd\u4f1a\u4e3a\u4e86\u5e02\u573a\u8425\u9500\u76ee\u7684\u6309\u7167\u6211\u4eec\u7684\u9690\u79c1\u6743\u653f\u7b56\u4e3a\u7b2c\u4e09\u65b9\u63d0\u4f9b\u603b\u4f53\u6216\u533f\u540d\u7684\u5e74\u9f84\u6570\u636e\u3002\u4f8b\u5982,\u6211\u4eec\u53ef\u80fd\u4f1a\u786e\u8ba4\u5728\u67d0\u5e74\u9f84\u6bb5\u5185\u5173\u6ce8\u67d0\u4e2a\u6216\u67d0\u4e9b\u7c7b\u522b\u7684\u8d26\u53f7\u7684\u7528\u6237\u6570\u76ee\u3002\u901a\u8fc7\u63d0\u4ea4\u4f60\u7684\u5e74\u9f84\u4fe1\u606f,\u4f60\u5c06\u540c\u610f\u6309\u7167\u4e0a\u8ff0\u5185\u5bb9\u5206\u4eab\u4f60\u7684\u4fe1\u606f\u3002",
