    "Before you enroll in login verification, we will send your phone a test message.": "\u5728\u4f60\u52a0\u5165\u767b\u5f55\u9a8c\u8bc1\u524d\uff0c\u6211\u4eec\u5c06\u5411\u4f60\u7684\u624b\u673a\u53d1\u9001\u4e00\u6761\u6d4b\u8bd5\u77ed\u4fe1\u3002",
    "Before you get started, it\u2019s important to understand that on Twitter, people choose to view your updates by searching for specific keywords or by following your account. This recipient-controlled model means that if you are compelling to people on Twitter, they\u2019ll choose to view your updates. The reverse is also true\u0026mdash;people may choose to un-follow you just as easily.": "\u5f00\u59cb\u524d,\u4f60\u9700\u8981\u77e5\u9053,\u5728 Twitter \u4e2d,\u7528\u6237\u53ef\u4ee5\u901a\u8fc7\u641c\u7d22\u7279\u5b9a\u5173\u952e\u5b57\u6216\u5173\u6ce8\u4f60\u7684\u8d26\u53f7\u7684\u65b9\u5f0f\u6765\u67e5\u770b\u4f60\u7684\u63a8\u6587\u66f4\u65b0\u3002\u8fd9\u79cd\u7531\u8bfb\u8005\u63a7\u5236\u7684\u6a21\u5f0f\u610f\u5473\u7740,\u5982\u679c\u4f60\u80fd\u5728 Twitter \u4e2d\u6fc0\u53d1\u4eba\u4eec\u5bf9\u4f60\u7684\u5174\u8da3,\u5927\u5bb6\u5c31\u4f1a\u5173\u6ce8\u5e76\u9605\u8bfb\u4f60\u7684\u63a8\u6587\u66f4\u65b0\u3002\u53cd\u4e4b\u4ea6\u540c,\u5927\u5bb6\u4e5f\u53ef\u4ee5\u8f7b\u6613\u5730\u53d6\u6d88\u5bf9\u4f60\u7684\u5173\u6ce8\u3002",
    "Before you leave Settings, check out the \u003Ca href=\"http://twitter.com/account/picture\"\u003EPicture\u003C/a\u003E tab, which is the place to add your company logo or photo of yourself. On the \u003Ca href=\"http://twitter.com/account/profile_settings\"\u003EDesign\u003C/a\u003E tab, you can upload a background image for your Twitter home page and tweak the page colors.": "\u79bb\u5f00\u8bbe\u7f6e\u9875\u9762\u524d\uff0c\u4e0d\u59a8\u770b\u770b\u003Ca href=\"http://twitter.com/account/picture\"\u003E\u5934\u50cf\u003C/a\u003E\u6807\u7b7e,\u5728\u8fd9\u91cc\u4f60\u53ef\u4ee5\u6dfb\u52a0\u516c\u53f8\u7684\u6807\u5fd7\u6216\u8005\u4e2a\u4eba\u7684\u7167\u7247\u3002\u5728\u003Ca href=\"http://twitter.com/account/profile_settings\"\u003E\u8bbe\u8ba1\u003C/a\u003E\u6807\u7b7e\u4e2d\uff0c\u4f60\u53ef\u4ee5\u4e3a\u4f60\u7684 Twitter \u4e3b\u9875\u4e0a\u4f20\u4e00\u5f20\u80cc\u666f\u56fe\u7247\u5e76\u8c03\u6574\u9875\u9762\u914d\u8272\u3002",
