    "Buttons, widgets, logos, and more": "\u6309\u94ae\u3001\u5c0f\u5de5\u5177\u3001\u6807\u5fd7\u4ee5\u53ca\u66f4\u591a",
    "By %{developer}": "\u4f5c\u8005 %{developer}",
    "By activating Twitter text messaging, you will be able to start receiving Twitter Alerts as SMS text messages. Note: others will be able to find you on Twitter by your phone number. You can change this through your account settings at any time.": "\u6fc0\u6d3b Twitter \u77ed\u4fe1\u610f\u5473\u7740\u4f60\u5c06\u901a\u8fc7\u77ed\u4fe1\u63a5\u6536 Twitter \u8b66\u62a5\u3002\u6ce8\u610f: \u5176\u4ed6\u4eba\u5c06\u53ef\u4ee5\u901a\u8fc7\u4f60\u7684\u624b\u673a\u53f7\u5728 Twitter \u4e0a\u627e\u5230\u4f60\u3002\u4f60\u53ef\u4ee5\u901a\u8fc7\u8d26\u53f7\u8bbe\u7f6e\u968f\u65f6\u4fee\u6539\u8fd9\u4e2a\u8bbe\u5b9a\u3002",
    "By anyone": "\u88ab\u4efb\u4f55\u4eba",
    "By authorizing an application you continue to operate under \u003Ca href=\"%{tos_link}\"\u003ETwitter's Terms of Service\u003C/a\u003E. In particular, some usage information will be shared back with Twitter. For more, see our \u003Ca href=\"%{privacy_link}\"\u003EPrivacy Policy\u003C/a\u003E.": "\u6388\u6743\u5e94\u7528\u7a0b\u5e8f\u610f\u5473\u7740\u4f60\u540c\u610f\u7ee7\u7eed\u6309 \u003Ca href=\"%{tos_link}\"\u003ETwitter \u670d\u52a1\u6761\u6b3e\u003C/a\u003E\u64cd\u4f5c\u3002\u7279\u522b\u5730\uff0c\u90e8\u5206\u4f7f\u7528\u4fe1\u606f\u5c06\u56de\u9988\u7ed9 Twitter\u3002\u8be6\u60c5\u53c2\u89c1\u003Ca href=\"%{privacy_link}\"\u003E\u9690\u79c1\u653f\u7b56\u003C/a\u003E\u3002",
    "By clicking \"Connect\" you agree to the Twitter \u003Ca href='%{tos_link}' target='_blank'\u003ETerms of Service\u003C/a\u003E.\n   In particular, some usage information will be shared back with Twitter.  For more, see our \u003Ca href=\"%{privacy_link}\" target=\"_blank\"\u003EPrivacy Policy\u003C/a\u003E.\u003Cbr /\u003ETwitter will never share your password and you can always revoke %{application}'s access through your \u003Ca href='%{connections_link}' target='_blank'\u003Esettings\u003C/a\u003E page.": "\u70b9\u51fb\u201c\u8fde\u63a5\u201d\u610f\u5473\u7740\u4f60\u540c\u610f Twitter \u003Ca href='%{tos_link}' target='_blank'\u003E\u670d\u52a1\u6761\u6b3e\u003C/a\u003E\u3002\u7279\u522b\u7684\uff0c\u90e8\u5206\u4f7f\u7528\u4fe1\u606f\u5c06\u56de\u9988\u7ed9 Twitter\u3002\u8981\u4e86\u89e3\u66f4\u591a\uff0c\u67e5\u770b\u6211\u4eec\u7684\u003Ca href=\"%{privacy_link}\" target=\"_blank\"\u003E\u9690\u79c1\u653f\u7b56\u003C/a\u003E\u3002\u003Cbr /\u003ETwitter \u5c06\u6c38\u8fdc\u4e0d\u4f1a\u4e0e %{application} \u5206\u4eab\u4f60\u7684\u5bc6\u7801\uff0c\u4f60\u4e5f\u53ef\u4ee5\u968f\u65f6\u5728\u003Ca href='%{connections_link}' target='_blank'\u003E\u8bbe\u7f6e\u003C/a\u003E\u9875\u9762\u79fb\u9664\u5176\u6743\u9650\u3002",
    "By clicking on \"Create my account\" below, you are agreeing to the \u003Ca href=\"%{tos_link}\" target=\"_blank\"\u003ETerms of Service\u003C/a\u003E above and the \u003Ca href=\"%{privacy_link}\" target=\"_blank\"\u003EPrivacy Policy\u003C/a\u003E.": "\u70b9\u51fb\u4e0b\u9762\u7684\u201c\u521b\u5efa\u6211\u7684\u8d26\u53f7\u201d\u610f\u5473\u7740\u4f60\u540c\u610f\u4e0a\u8ff0\u003Ca href=\"%{tos_link}\" target=\"_blank\"\u003E\u670d\u52a1\u6761\u6b3e\u003C/a\u003E\u4e0e\u003Ca href=\"%{privacy_link}\" target=\"_blank\"\u003E\u9690\u79c1\u653f\u7b56\u003C/a\u003E\u3002",
    "By clicking submit you agree to the \u003Ca href=\"{{tos_path}}\"\u003Eterms of service\u003C/a\u003E and our \u003Ca href=\"{{privacy_path}}\"\u003Eprivacy policy\u003C/a\u003E": "\u70b9\u51fb\u63d0\u4ea4\u610f\u5473\u7740\u4f60\u540c\u610f\u003Ca href=\"{{tos_path}}\"\u003E\u670d\u52a1\u6761\u6b3e\u003C/a\u003E\u548c\u6211\u4eec\u7684\u003Ca href=\"{{privacy_path}}\"\u003E\u9690\u79c1\u653f\u7b56\u003C/a\u003E",
    "By clicking the button, you agree to the terms below:": "\u70b9\u51fb\u6309\u94ae\u610f\u5473\u7740\u4f60\u540c\u610f\u4e0b\u8ff0\u6761\u6b3e:",
    "By connecting your accounts, your tweets can be published to your Facebook wall.": "\u901a\u8fc7\u8fde\u63a5\u4f60\u7684\u8d26\u53f7,\u4f60\u7684\u63a8\u6587\u5c06\u53d1\u5e03\u5230\u4f60\u7684 Facebook \u6d82\u9e26\u5899\u4e0a\u3002",
    "By creating an account, you are agreeing to the \u003Ca href=\"/tos\" target=\"_blank\"\u003ETerms of Service\u003C/a\u003E and \u003Ca href=\"/privacy\" target=\"_blank\"\u003EPrivacy Policy\u003C/a\u003E. Others will be able to find you by name, username or email. Your email will not be shown publicly. You can change your privacy settings at any time.": "\u521b\u5efa\u8d26\u53f7\u610f\u5473\u7740\u4f60\u540c\u610f\u003Ca href=\"/tos\" target=\"_blank\"\u003E\u670d\u52a1\u6761\u6b3e\u003C/a\u003E\u4e0e\u003Ca href=\"/privacy\" target=\"_blank\"\u003E\u9690\u79c1\u653f\u7b56\u003C/a\u003E\u3002\u5176\u4ed6\u4eba\u5c06\u53ef\u4ee5\u901a\u8fc7\u540d\u5b57\u3001\u7528\u6237\u540d\u6216\u90ae\u4ef6\u5730\u5740\u627e\u5230\u4f60\u3002\u4f60\u7684\u90ae\u4ef6\u5730\u5740\u4e0d\u4f1a\u516c\u5f00\u663e\u793a\uff0c\u540c\u65f6\u4f60\u4e5f\u53ef\u4ee5\u968f\u65f6\u66f4\u6539\u9690\u79c1\u8bbe\u7f6e\u3002",
    "By creating your account you accept our \u003Ca href=\"/tos\" target=\"_blank\"\u003ETerms\u003C/a\u003E.": "\u521b\u5efa\u4f60\u7684\u8d26\u53f7\u610f\u5473\u7740\u4f60\u63a5\u53d7\u6211\u4eec\u7684\u003Ca href=\"/tos\" target=\"_blank\"\u003E\u670d\u52a1\u6761\u6b3e\u003C/a\u003E\u3002",
    "By default, you can initiate a password reset by entering only your @username. If you check this box, you will be prompted to enter your email address or phone number if you forget your password.": "\u9ed8\u8ba4\u60c5\u51b5\u4e0b\uff0c\u53ea\u8981\u77e5\u9053\u4e86\u4f60\u7684 @\u7528\u6237\u540d \u5c31\u53ef\u4ee5\u91cd\u7f6e\u5bc6\u7801\u3002\u5982\u679c\u52fe\u9009\u4e86\u8be5\u590d\u9009\u6846\uff0c\u91cd\u7f6e\u5bc6\u7801\u65f6\u4f60\u5c06\u88ab\u63d0\u793a\u8f93\u5165\u7535\u8bdd\u53f7\u7801\u6216\u90ae\u4ef6\u5730\u5740\u3002",
    "By downloading these logos, you agree to the \u003Ca href=\"%{link}\"\u003EGuidelines for use of the Twitter Trademark\u003C/a\u003E.": "\u4e0b\u8f7d\u8fd9\u4e9b\u6807\u5fd7\u610f\u5473\u7740\u4f60\u5df2\u540c\u610f\u003Ca href=\"%{link}\"\u003E\u300aTwitter \u5546\u6807\u4f7f\u7528\u89c4\u8303\u300b\u003C/a\u003E\u3002",
    "By people I follow": "\u88ab\u6211\u5173\u6ce8\u7684\u4eba",
    "By signing in here, you can use %{application_name} without sharing your Twitter password.": "\u901a\u8fc7\u5728\u8fd9\u91cc\u767b\u5f55,\u4f60\u53ef\u4ee5\u4f7f\u7528 %{application_name} \u800c\u65e0\u9700\u5171\u4eab Twitter \u5bc6\u7801\u3002",
    "By turning on this feature, you can include location information like neighborhood, town, or exact point when you tweet.": "\u5f00\u542f\u8fd9\u9879\u529f\u80fd\u53ef\u5728\u53d1\u5e03\u63a8\u6587\u65f6\u9644\u5e26\u4f4d\u7f6e,\u5982\u8857\u533a\u3001\u57ce\u9547\u6216\u53d1\u63a8\u7684\u786e\u5207\u4f4d\u7f6e\u3002",
