    "For advanced visual options, please refer to \u003Ca href=\"https://dev.twitter.com/docs/embedded-timelines#customization\"\u003Ethe customization documentation\u003C/a\u003E.": "\u5173\u4e8e\u9ad8\u7ea7\u89c6\u89c9\u9009\u9879\uff0c\u8bf7\u53c2\u8003\u003Ca href=\"https://dev.twitter.com/docs/embedded-timelines#customization\"\u003E\u81ea\u5b9a\u4e49\u6587\u6863\u003C/a\u003E\u3002",
    "For all non-media inquiries, visit our \u003Ca href='/help'\u003EHelp Center\u003C/a\u003E.": "\u5bf9\u4e8e\u6240\u6709\u975e\u5a92\u4f53\u76f8\u5173\u8bf7\u6c42\uff0c\u8bf7\u8bbf\u95ee\u6211\u4eec\u7684\u003Ca href='/help'\u003E\u5e2e\u52a9\u4e2d\u5fc3\u003C/a\u003E\u3002",
