    "For dark backgrounds": "\u7528\u4e8e\u6df1\u8272\u80cc\u666f",
    "For example, if you visit sports websites, we might suggest teams and players that are popular and widely followed by other Twitter users that visit those sports websites.": "\u4f8b\u5982,\u5982\u679c\u4f60\u6d4f\u89c8\u4e86\u4f53\u80b2\u7f51\u7ad9,\u6211\u4eec\u53ef\u80fd\u4f1a\u63a8\u8350\u548c\u4f60\u4e00\u6837\u8bbf\u95ee\u8fc7\u90a3\u4e9b\u7f51\u7ad9\u7684 Twitter \u7528\u6237\u6240\u5173\u6ce8\u7684\u8f83\u591a\u7684\u70ed\u95e8\u7403\u961f\u6216\u8fd0\u52a8\u5458\u3002",
    "For full broadcast guidelines, please see our resource on \u003Ca href=\"https://support.twitter.com/articles/114233\"\u003Eour Help Center\u003C/a\u003E.": "\u5173\u4e8e\u5b8c\u6574\u7684\u7535\u89c6\u5e7f\u64ad\u6307\u5357,\u8bf7\u67e5\u770b\u003Ca href=\"https://support.twitter.com/articles/114233\"\u003E\u6211\u4eec\u7684\u5e2e\u52a9\u4e2d\u5fc3\u003C/a\u003E\u4e2d\u7684\u76f8\u5173\u8d44\u6e90\u3002",
    "For general inquiries or to request support with your twitter account, please visit us at Twitter Support.": "\u5982\u9700\u5e38\u89c4\u54a8\u8be2\u6216\u8bf7\u6c42 Twitter \u8d26\u53f7\u652f\u6301,\u8bf7\u8bbf\u95ee\u6211\u4eec\u7684 Twitter \u652f\u6301\u3002",
    "For information relating to use of the Vine trademarks or how to display videos from Vine, please see \u003Ca href=\"http://vine.co/logo\"\u003Evine.co/logo\u003C/a\u003E.": "\u8981\u4e86\u89e3\u5173\u4e8e\u4f7f\u7528 Vine \u5546\u6807\u6216\u8005\u5982\u4f55\u64ad\u653e\u6765\u81ea Vine \u7684\u89c6\u9891\u7684\u4fe1\u606f\uff0c\u8bf7\u6d4f\u89c8 \u003Ca href=\"http://vine.co/logo\"\u003Evine.co/logo\u003C/a\u003E\u3002",
    "For light backgrounds": "\u7528\u4e8e\u6d45\u8272\u80cc\u666f",
    "For locations where many people share the same IP address (e.g., corporations and conferences), our rate limits may be too strict. If you believe you are using Twitter normally, please \u003Ca href=\"{{support_path}}\"\u003Elet us know\u003C/a\u003E.": "\u5bf9\u4e8e\u6765\u81ea\u4e8e\u540c\u6837 IP \u5730\u5740\u7684\u5730\u5740(\u5982\u516c\u53f8,\u4f1a\u573a\u7b49)\u7684\u7528\u6237,\u6211\u4eec\u7684\u9891\u7387\u9650\u5236\u53ef\u80fd\u592a\u4e25\u683c\u4e86\u3002\u5982\u679c\u4f60\u8ba4\u4e3a\u4f60\u6b63\u5728\u6b63\u5e38\u4f7f\u7528 Twitter,\u8bf7 \u003Ca href=\"{{support_path}}\"\u003E\u544a\u8bc9\u6211\u4eec\u003C/a\u003E\u3002",
    "For more information about the data mining feed, please see the \u003Ca href=\"http://dev.twitter.com/pages/streaming_api\"\u003Edocumentation\u003C/a\u003E.": "\u60f3\u4e86\u89e3\u6709\u5173\u6570\u636e\u6316\u6398 Feed \u6e90\u7684\u66f4\u591a\u4fe1\u606f,\u8bf7\u53c2\u9605 \u003Ca href=\"http://dev.twitter.com/pages/streaming_api\"\u003E\u6587\u6863\u003C/a\u003E\u3002",
    "For more information, please review the \u003Ca href=\"%{help_url}\"\u003ETwitter Rules\u003C/a\u003E.": "\u8981\u83b7\u53d6\u66f4\u591a\u4fe1\u606f,\u8bf7\u6d4f\u89c8 \u003Ca href=\"%{help_url}\"\u003ETwitter \u5b88\u5219\u003C/a\u003E\u3002",
    "For more information, please review the Twitter Rules ( %{help_url} ).": "\u8981\u83b7\u53d6\u66f4\u591a\u4fe1\u606f,\u8bf7\u6d4f\u89c8 Twitter \u5b88\u5219 (%{help_url})\u3002",
    "For more information, please visit \u003Ca href=\"{{suspended_help_path}}\"\u003ESuspended Accounts\u003C/a\u003E.": "\u8981\u83b7\u53d6\u66f4\u591a\u4fe1\u606f\uff0c\u8bf7\u8bbf\u95ee\u003Ca href=\"{{suspended_help_path}}\"\u003E\u5df2\u51bb\u7ed3\u8d26\u53f7\u003C/a\u003E\u3002",
