    "For more information, visit our help page %{help_url} for hacked or compromised accounts.": "\u8981\u83b7\u53d6\u66f4\u591a\u4fe1\u606f,\u8bf7\u8bbf\u95ee\u6211\u4eec\u5173\u4e8e\u88ab\u653b\u51fb\u6216\u88ab\u5192\u7528\u7684\u8d26\u53f7\u7684\u5e2e\u52a9\u9875\u9762%{help_url}\u3002",
    "For ongoing information about Twitter, please read our \u003Ca href=\"http://blog.twitter.com\"\u003Ecompany blog\u003C/a\u003E. Also, feel free to contact us with service questions, partnership proposals, or media inquiries.": "\u66f4\u591a\u5173\u4e8e Twitter \u7684\u4fe1\u606f\uff0c\u8bf7\u9605\u8bfb\u6211\u4eec\u7684\u003Ca href=\"http://blog.twitter.com\"\u003E\u4f01\u4e1a\u535a\u5ba2\u003C/a\u003E\u3002\u5982\u6709\u670d\u52a1\u95ee\u9898\u3001\u5408\u4f5c\u610f\u5411\u6216\u5a92\u4f53\u54a8\u8be2\u7684\u8981\u6c42\uff0c\u656c\u8bf7\u8054\u7cfb\u6211\u4eec\u3002",
    "For starters, we're allowing you to both register your application here, as well as providing an improved Authentication System, OAuth. To read more about how this help both you and your users, please visit \u003Ca href=\"http://oauth.net/\"\u003Ehttp://oauth.net\u003C/a\u003E.": "\u5bf9\u4e8e\u521d\u5b66\u8005\u6765\u8bf4, \u6211\u4eec\u5141\u8bb8\u4f60\u6ce8\u518c\u4f60\u7684\u5e94\u7528\u7a0b\u5e8f\u5e76\u63d0\u4f9b\u4e86\u4e00\u4e2a\u6539\u8fdb\u7684\u8ba4\u8bc1\u7cfb\u7edf OAuth\u3002\u9605\u8bfb\u66f4\u591a\u4e86\u89e3\u5982\u4f55\u5e2e\u52a9\u4f60\u548c\u4f60\u7684\u7528\u6237, \u8bf7\u8bbf\u95ee \u003Ca href=\"http://oauth.net/\"\u003Ehttp://oauth.net\u003C/a\u003E",
    "For the best experience, download Twitter for your phone! Visit twitter.com/download": "\u4e3a\u4e86\u83b7\u5f97\u6700\u4f73\u4f53\u9a8c,\u4e3a\u4f60\u7684\u624b\u673a\u4e0b\u8f7d Twitter \u5ba2\u6237\u7aef! \u8bbf\u95ee twitter.com/download",
    "For tips on selecting a strong password, see our \u003Ca href='%{url}'\u003ESafe Tweeting help page\u003C/a\u003E.": "\u9009\u62e9\u5f3a\u5bc6\u7801\u7684\u63d0\u793a\u8bf7\u53c2\u89c1\u6211\u4eec\u7684\u003Ca href='%{url}'\u003E\u201c\u5b89\u5168\u53d1\u63a8\u201d\u5e2e\u52a9\u9875\u9762\u003C/a\u003E\u3002",
    "For tips on selecting a strong password, see our Safe Tweeting help page: %{url}": "\u5982\u4f55\u6311\u9009\u5f3a\u5bc6\u7801? \u8bf7\u53c2\u89c1\u6211\u4eec\u7684\u201c\u5b89\u5168\u53d1\u63a8\u201d\u5e2e\u52a9\u9875\u9762: %{url}",
    "For your protection, we've disabled email-based password reset on your account. You can easily request a new password by entering your phone number. You'll get a password reset code in a text message.": "\u4e3a\u4e86\u4f60\u7684\u5b89\u5168,\u6211\u4eec\u5df2\u7981\u6b62\u901a\u8fc7\u90ae\u7bb1\u91cd\u7f6e\u8d26\u53f7\u5bc6\u7801\u3002\u4f60\u53ef\u4ee5\u901a\u8fc7\u8f93\u5165\u624b\u673a\u53f7\u7801\u6765\u8bf7\u6c42\u4e00\u4e2a\u65b0\u5bc6\u7801\u3002\u4f60\u5c06\u6536\u5230\u5305\u542b\u5bc6\u7801\u91cd\u7f6e\u7801\u7684\u77ed\u4fe1\u3002",
