    "Founded in 2007, Twitter Inc believes the open exchange of information can have a positive global impact. Every \"Tweet\" is limited to 140 characters of text or links which means they are easily written or read on a wide variety of services and devices including any mobile phone, social networks, television, Macs, PCs, and the Web.": "\u8bde\u751f\u4e8e 2007 \u5e74\u7684 Twitter \u516c\u53f8\u76f8\u4fe1\u5f00\u653e\u7684\u4fe1\u606f\u4ea4\u6362\u53ef\u4ee5\u8ba9\u8fd9\u4e2a\u4e16\u754c\u53d8\u5f97\u66f4\u597d\u3002\u6bcf\u4e00\u6761\u201c\u63a8\u6587\u201d\u662f\u4e0d\u8d85\u8fc7 140 \u5b57\u7684\u6587\u672c\u6216\u8005\u94fe\u63a5,\u8fd9\u610f\u5473\u7740\u5b83\u4eec\u80fd\u591f\u66f4\u5bb9\u6613\u5730\u5728\u5404\u79cd\u670d\u52a1\u548c\u8bbe\u5907\u4e0a\u9605\u8bfb\u6216\u4e66\u5199,\u6bd4\u65b9\u8bf4\u624b\u673a\u3001\u793e\u4ea4\u7f51\u7edc\u3001\u7535\u89c6\u3001\u7535\u8111\u548c\u4e92\u8054\u7f51\u3002",
