    "In reply to you:": "\u56de\u590d\u4f60:",
    "In reply to your follower {{\u003Euser_list}}": "\u56de\u590d\u7ed9\u4f60\u7684\u5173\u6ce8\u8005 {{\u003Euser_list}}",
    "In reply to your followers {{\u003Euser_list}}": "\u56de\u590d\u7ed9\u4f60\u7684\u5173\u6ce8\u8005 {{\u003Euser_list}}",
    "In reply to {{#root_tweeter}}{{name}}{{/root_tweeter}}": "\u56de\u590d\u7ed9 {{#root_tweeter}}{{name}}{{/root_tweeter}}",
    "In reply to {{\u003Euser_list}}": "\u56de\u590d\u7ed9 {{\u003Euser_list}}",
