    "In reply to {{\u003Euser_list}}, who follows you": "\u56de\u590d\u7ed9\u5173\u6ce8\u4e86\u4f60\u7684 {{\u003Euser_list}}",
    "In reply to {{inReplyToTweetAuthor}}": "\u56de\u590d {{inReplyToTweetAuthor}}",
    "In reply to {{inReplyToTweetAuthor}} and {{othersLeft}} others": "\u56de\u590d\u7ed9 {{inReplyToTweetAuthor}} \u53ca\u53e6\u5916{{othersLeft}}\u4eba",
    "In reply to {{rootTweetAuthor}}": "\u56de\u590d\u7ed9 {{rootTweetAuthor}}",
    "In reply to {{rootTweetAuthor}} and {{inReplyToTweetAuthor}}": "\u56de\u590d{{rootTweetAuthor}}\u53ca{{inReplyToTweetAuthor}}",
    "In reply to {{rootTweetAuthor}}, {{inReplyToTweetAuthor}} and {{othersLeft}} others": "\u56de\u590d\u7ed9 {{rootTweetAuthor}}\u3001{{inReplyToTweetAuthor}} \u53ca\u53e6\u5916{{othersLeft}}\u4eba",
    "In reply to {{root_tweeter}}{{name}}": "\u56de\u590d\u7ed9 {{root_tweeter}}{{name}}",
    "In reply to:": "\u56de\u590d\u7ed9:",
    "In reply to\u2026": "\u56de\u590d\u7ed9...",
    "In the `data` folder, your Twitter archive is present in two formats: JSON and CSV exports by month and year.": "\u5728 `data` \u6587\u4ef6\u5939\u4e0b\uff0c\u4f60\u7684 Twitter \u5b58\u6863\u662f\u901a\u8fc7\u4e24\u79cd\u683c\u5f0f\u6765\u4fdd\u5b58\u7684: JSON \u548c CSV\uff0c\u5e76\u6309\u7167\u6708\u4efd\u548c\u5e74\u4efd\u8f93\u51fa\u3002",
    "In this preview, you may see some people you already follow.": "\u5728\u8be5\u9884\u89c8\u4e2d,\u4f60\u53ef\u80fd\u4f1a\u770b\u89c1\u4e00\u4e9b\u4f60\u5df2\u7ecf\u5173\u6ce8\u7684\u4eba\u3002",
    "In times of crisis, this account helps share critical information with Twitter Alerts.": "\u5371\u6025\u60c5\u51b5\u65f6\uff0c\u8be5\u8d26\u53f7\u5c06\u901a\u8fc7 Twitter \u8b66\u62a5\u5206\u4eab\u7d27\u6025\u4fe1\u606f\u3002",
    "Inactive": "\u4e0d\u6d3b\u8dc3",
    "Inbox": "\u6536\u4ef6\u7bb1",
    "Incheon": "\u4ec1\u5ddd",
    "Include \u003Cspan class=\"pretty-link\"\u003E\u003Cs\u003E@\u003C/s\u003E\u003Cb\u003E{{#user}}{{screen_name}}{{/user}}\u003C/b\u003E\u003C/span\u003E in:": "\u5c06 \u003Cspan class=\"pretty-link\"\u003E\u003Cs\u003E@\u003C/s\u003E\u003Cb\u003E{{#user}}{{screen_name}}{{/user}}\u003C/b\u003E\u003C/span\u003E \u5217\u5165:",
    "Include \u003Cspan class=\"pretty-link\"\u003E\u003Cs\u003E@\u003C/s\u003E\u003Cb\u003E{{screen_name}}\u003C/b\u003E\u003C/span\u003E in:": "\u6dfb\u52a0 \u003Cspan class=\"pretty-link\"\u003E\u003Cs\u003E@\u003C/s\u003E\u003Cb\u003E{{screen_name}}\u003C/b\u003E\u003C/span\u003E \u5230:",
