    "Maintaining top notch security online is always a community effort, and we're lucky to have a vibrant group of independent security researchers who volunteer their time to help us spot potential issues. We applaud their efforts and the important role they play in keeping Twitter safe for everyone.": "\u80fd\u591f\u4fdd\u6301\u4e00\u6d41\u5728\u7ebf\u5b89\u5168\u59cb\u7ec8\u90fd\u6765\u6e90\u4e8e\u4e00\u4e2a\u793e\u533a\u7684\u52aa\u529b,\u6211\u4eec\u5f88\u5e78\u8fd0,\u6709\u4e00\u7fa4\u5145\u6ee1\u6d3b\u529b\u7684\u72ec\u7acb\u5b89\u5168\u7814\u7a76\u4eba\u5458\u65e0\u79c1\u5730\u82b1\u65f6\u95f4\u6765\u5e2e\u52a9\u6211\u4eec\u53d1\u73b0\u6f5c\u5728\u7684\u95ee\u9898\u3002\u6211\u4eec\u8d5e\u8d4f\u4ed6\u4eec\u7684\u52aa\u529b\u548c\u4ed6\u4eec\u4e3a\u6bcf\u4e2a\u7528\u6237\u7ef4\u62a4 Twitter \u5b89\u5168\u53d1\u6325\u7684\u91cd\u8981\u4f5c\u7528\u3002",
