    "Make sure Tweets shown on air include name, @username, and unmodified Tweet text with the Twitter bird nearby.": "\u786e\u4fdd\u5728\u4e0a\u65b9\u663e\u793a\u7684\u63a8\u6587\u5305\u62ec\u5168\u540d\u3001@\u7528\u6237\u540d\u3001\u672a\u7ecf\u4fee\u6539\u7684\u63a8\u6587\u6587\u5b57\u548c\u9644\u8fd1\u7684 Twitter \u5c0f\u9e1f\u3002",
