    "Make sure that if mentioning \"Tweet,\" you include a direct reference to Twitter (for instance, \"Tweet with Twitter\") or display the Twitter brand or trademarks with the mention of \"Tweet.\"": "\u5982\u679c\u63d0\u53ca\u201c\u63a8\u6587\u201d,\u52a1\u5fc5\u76f4\u63a5\u5f15\u7528\u53d1\u63a8\u4eba (\u4f8b\u5982,\u201c\u7528 Twitter \u53d1\u5e03\u63a8\u6587\u201d) \u6216\u8005\u663e\u793a\u53d1\u63a8\u4eba\u7684\u54c1\u724c\u6216\u5546\u6807\u7684\u201c\u63a8\u6587\u201d\u3002",
    "Make sure the bird faces right.": "\u786e\u4fdd\u5c0f\u9e1f\u9762\u671d\u53f3\u8fb9\u3002",
    "Make sure the title of your book or publication makes clear that it's about Twitter, and not by Twitter. For example, \"Learning how to 'X' on Twitter\" is appropriate, whereas \"The Twitter guide to 'X'\" is not.": "\u786e\u4fdd\u4f60\u5728\u56fe\u4e66\u6216\u520a\u7269\u4e0a\u7684\u6807\u9898\u6e05\u695a\u7684\u8bf4\u660e\u4e86 \u201c\u4e0e Twitter \u6709\u5173\u201d,\u800c\u4e0d\u662f \u201c\u901a\u8fc7 Twitter\u201d\u3002\u4f8b\u5982, \u201c\u5728 Twitter \u4e0a\u5b66\u4e60\u5982\u4f55\u53bb \u2018X\u2019\u201d \u662f\u53ef\u4ee5\u7684,\u800c \u201cTwitter \u2018X\u2019 \u6307\u5357\u201d \u662f\u4e0d\u5408\u9002\u7684\u3002",
    "Make sure the title of your book or publication makes clear that it's about Twitter, and not created by Twitter. For example, \"Learning how to 'X' on Twitter\" is appropriate, whereas \"The Twitter guide to 'X'\" is not.": "\u786e\u4fdd\u4f60\u7684\u4e66\u6216\u51fa\u7248\u7269\u7684\u6807\u9898\u80fd\u786e\u5207\u8868\u660e\u5176\u4e0e Twitter \u6709\u5173\uff0c\u4f46\u662f\u5e76\u975e Twitter \u6240\u4f5c\u3002\u4f8b\u5982\uff0c\u201c\u5982\u4f55\u5728 Twitter \u4e0a \u2018xxx\u2019\u201d\u662f\u6070\u5f53\u7684\uff0c\u4f46\u662f\u201cTwitter \u7684 \u2018xxx\u2019\u6307\u5357\u201d\u5c31\u4e0d\u884c\u4e86\u3002",
