    "Note: Others will be able to find you by name, username, email, or phone number. Your email and phone number will not be shown publicly. You can change your privacy settings at any time.": "\u6ce8\u610f: \u5176\u4ed6\u4eba\u53ef\u4ee5\u901a\u8fc7\u4f60\u7684\u59d3\u540d\u3001\u7528\u6237\u540d\u6216\u90ae\u4ef6\u5730\u5740\u627e\u5230\u4f60\u3002\u4f60\u7684\u90ae\u4ef6\u5730\u5740\u548c\u624b\u673a\u53f7\u5c06\u4e0d\u4f1a\u516c\u5f00\u663e\u793a\uff0c\u540c\u65f6\u4f60\u53ef\u4ee5\u968f\u65f6\u4fee\u6539\u9690\u79c1\u8bbe\u7f6e\u3002",
    "Note: This carrier only allows you to send messages to Twitter. Twitter will not be able to send you text message notifications.": "\u6ce8\u610f:\u8be5\u8fd0\u8425\u5546\u4ec5\u5141\u8bb8\u4f60\u53d1\u9001\u6d88\u606f\u5230 Twitter\u3002\u4f46 Twitter \u4e0d\u80fd\u5411\u4f60\u53d1\u9001\u77ed\u4fe1\u901a\u77e5\u3002",
    "Note: This carrier only allows you to send messages to Twitter. Twitter will not be able to send you text message notifications. Try using \u003Ca href=\"http://m.twitter.com\"\u003Em.twitter.com\u003C/a\u003E on your phone to view your Tweets.": "\u6ce8\u610f: \u8be5\u8fd0\u8425\u5546\u4ec5\u5141\u8bb8\u4f60\u53d1\u9001\u6d88\u606f\u5230 Twitter\u3002\u4f46 Twitter \u4e0d\u80fd\u5411\u4f60\u53d1\u9001\u77ed\u4fe1\u901a\u77e5\u3002\u8bf7\u5c1d\u8bd5\u4f7f\u7528 \u003Ca href=\"http://m.twitter.com\"\u003Em.twitter.com\u003C/a\u003E \u6765\u67e5\u770b\u4f60\u7684\u63a8\u6587\u3002",
    "Note: To use these shortcuts, users of screen readers may need to toggle off the virtual navigation.": "\u6ce8\u610f: \u5c4f\u5e55\u9605\u8bfb\u5668\u7684\u7528\u6237\u9700\u8981\u5173\u95ed\u865a\u62df\u5bfc\u822a\u529f\u80fd\u624d\u80fd\u4f7f\u7528\u8fd9\u4e9b\u5feb\u6377\u952e\u3002",
    "Note: Widget size won't update in preview.": "\u6ce8: \u5c0f\u5de5\u5177\u7684\u5c3a\u5bf8\u5728\u9884\u89c8\u4e2d\u4e0d\u4f1a\u66f4\u65b0\u3002",
    "Note: Your carrier may charge you an international text messaging tariff to send a Tweet.": "\u6ce8\u610f: \u4f60\u7684\u8fd0\u8425\u5546\u53ef\u80fd\u4f1a\u5411\u4f60\u6536\u53d6\u53d1\u9001\u63a8\u6587\u65f6\u4ea7\u751f\u7684\u56fd\u9645\u77ed\u4fe1\u8d39\u7528\u3002",
    "Note: Your phone notifications setting for tweets is currently off.": "\u6ce8\u610f: \u4f60\u7684\u63a8\u6587\u624b\u673a\u901a\u77e5\u8bbe\u7f6e\u76ee\u524d\u5173\u95ed\u3002",
    "Note: email will not be publicly displayed.": "\u6ce8: \u90ae\u4ef6\u5730\u5740\u4e0d\u4f1a\u516c\u5f00\u663e\u793a\u3002",
    "Notification: Media Setting Changed": "\u901a\u77e5: \u5a92\u4f53\u5185\u5bb9\u8bbe\u7f6e\u5df2\u66f4\u6539",
    "Notification: Media Setting Locked": "\u63d0\u9192: \u5a92\u4f53\u5185\u5bb9\u8bbe\u7f6e\u88ab\u9501\u5b9a",
    "Notifications": "\u901a\u77e5",
    "Notify me when": "\u5728\u4ee5\u4e0b\u60c5\u51b5\u4e0b\u901a\u77e5\u6211",
    "Nottingham": "\u8bfa\u4e01\u6c49",
    "Nov": "11\u6708",
