    "So much happens on Twitter every day, whether it's breaking news, a deal at your favorite shop, a local traffic jam or a funny pick-me-up from a friend. Twitter keeps you informed with what matters most to you today and helps you discover what might matter to you most tomorrow.": "\u5728 Twitter\uff0c\u6bcf\u5929\u90fd\u6709\u5f88\u591a\u4e8b\u60c5\u53d1\u751f\uff0c\u65e0\u8bba\u662f\u7a81\u53d1\u65b0\u95fb\u3001\u6700\u7231\u5e97\u94fa\u7684\u4f18\u60e0\uff0c\u8fd8\u662f\u5f53\u5730\u7684\u4ea4\u901a\u5835\u585e\u6216\u670b\u53cb\u7684\u6709\u8da3\u5c0f\u7b11\u8bdd\u3002Twitter \u8ba9\u4f60\u59cb\u7ec8\u4e86\u89e3\u4eca\u5929\u7684\u65b0\u9c9c\u4e8b\u60c5\uff0c\u5e2e\u52a9\u4f60\u53d1\u73b0\u66f4\u52a0\u7cbe\u5f69\u7684\u660e\u5929\u3002",
