    "Someone shares a Tweet with me": "\u6709\u4eba\u4e0e\u6211\u5206\u4eab\u4e86\u4e00\u6761\u63a8\u6587",
    "Someone you may know is on Twitter": "\u4f60\u5728 Twitter \u4e0a\u53ef\u80fd\u8ba4\u8bc6\u7684\u4eba",
    "Something else?": "\u8fd8\u6709\u5176\u4ed6\u4e48?",
    "Something is technically wrong.": "\u51fa\u73b0\u4e86\u4e00\u4e9b\u6280\u672f\u6027\u9519\u8bef\u3002",
    "Something is wrong, nobody was invited :-(": "\u51fa\u9519,\u6ca1\u6709\u8c01\u53d7\u5230\u9080\u8bf7 :-(",
    "Something went wrong when trying to follow %{friend}.  Please try again later.": "\u8bd5\u56fe\u5173\u6ce8 %{friend} \u65f6\u51fa\u73b0\u4e86\u9519\u8bef\u3002\u8bf7\u7a0d\u540e\u518d\u8bd5\u3002",
