    "Sorry! We did something wrong. Try sending your message again in a minute": "\u5bf9\u4e0d\u8d77! \u6211\u4eec\u8fd9\u513f\u51fa\u4e86\u70b9\u95ee\u9898\u3002\u8bf7\u7a0d\u540e\u518d\u5c1d\u8bd5\u53d1\u9001\u79c1\u4fe1",
    "Sorry! We did something wrong. Try sending your tweet again in a minute": "\u5bf9\u4e0d\u8d77! \u6211\u4eec\u8fd9\u513f\u51fa\u4e86\u70b9\u95ee\u9898\u3002\u8bf7\u7a0d\u540e\u518d\u5c1d\u8bd5\u53d1\u9001\u63a8\u6587",
    "Sorry, %{user} must follow you to recieve Direct Messages.": "\u62b1\u6b49,%{user} \u5fc5\u987b\u5173\u6ce8\u4f60\u624d\u80fd\u6536\u5230\u4f60\u7684\u79c1\u4fe1\u3002",
    "Sorry, This page is not supported by your browser.  Please upgrade, or use another browser.": "\u62b1\u6b49, \u4f60\u7684\u8bbe\u5907\u8fd8\u4e0d\u652f\u6301\u8be5\u9875\u9762\u3002\u8bf7\u5347\u7ea7\u6216\u4f7f\u7528\u53e6\u4e00\u4e2a\u6d4f\u89c8\u5668\u3002",
