    "Sorry, but you've reached your limit on email updates for now.": "\u5bf9\u4e0d\u8d77,\u4f60\u5df2\u8fbe\u5230\u5f53\u524d\u7535\u5b50\u90ae\u4ef6\u66f4\u65b0\u7684\u9650\u5236\u3002",
    "Sorry, but you've reached your limit on searches for now.": "\u5bf9\u4e0d\u8d77,\u53ef\u662f\u4f60\u5df2\u8fbe\u5230\u5f53\u524d\u641c\u7d22\u6b21\u6570\u9650\u989d\u3002",
    "Sorry, iframes are not supported.": "\u5bf9\u4e0d\u8d77,\u5185\u5d4c\u6846\u67b6\u4e0d\u88ab\u652f\u6301\u3002",
    "Sorry, local trends are temporarily unavailable.": "\u5bf9\u4e0d\u8d77,\u672c\u5730\u8d8b\u52bf\u6682\u65f6\u4e0d\u53ef\u7528\u3002",
    "Sorry, please try again later.": "\u5bf9\u4e0d\u8d77,\u8bf7\u7a0d\u540e\u518d\u8bd5\u3002",
    "Sorry, something went wrong on our side. Please try again later.": "\u5bf9\u4e0d\u8d77,\u6211\u4eec\u8fd9\u91cc\u51fa\u73b0\u4e86\u4e00\u4e9b\u95ee\u9898,\u8bf7\u7a0d\u540e\u518d\u8bd5\u3002",
    "Sorry, something went wrong.": "\u5bf9\u4e0d\u8d77\uff0c\u51fa\u9519\u4e86\u3002",
