    "Sorry, there are no top images for \u003Cstrong\u003E{{query}}\u003C/strong\u003E.": "\u5bf9\u4e0d\u8d77,\u6ca1\u6709 \u003Cstrong\u003E{{query}}\u003C/strong\u003E \u7684\u70ed\u95e8\u56fe\u7247\u3002",
    "Sorry, there are no top videos for \u003Cstrong\u003E{{query}}\u003C/strong\u003E.": "\u5bf9\u4e0d\u8d77,\u6ca1\u6709 \u003Cstrong\u003E{{query}}\u003C/strong\u003E \u7684\u70ed\u95e8\u89c6\u9891\u3002",
