    "Sorry, there was an unexpected error generating the widget preview. You may continue to configure your widget.": "\u62b1\u6b49, \u5728\u751f\u6210\u5c0f\u5de5\u5177\u9884\u89c8\u7684\u65f6\u5019\u9047\u5230\u4e86\u4e00\u4e2a\u672a\u77e5\u9519\u8bef\u3002\u4f60\u53ef\u4ee5\u7ee7\u7eed\u914d\u7f6e\u4f60\u7684\u5c0f\u5de5\u5177\u3002",
    "Sorry, this account has been suspended.": "\u5bf9\u4e0d\u8d77,\u6b64\u5e10\u6237\u5df2\u88ab\u51bb\u7ed3\u3002",
