    "Sorry, this page is not yet supported on your device.  Please open the link on a different mobile device or desktop web browser.": "\u62b1\u6b49,\u4f60\u7684\u8bbe\u5907\u8fd8\u4e0d\u652f\u6301\u8be5\u9875\u9762\u3002\u8bf7\u5c1d\u8bd5\u5728\u5176\u5b83\u79fb\u52a8\u8bbe\u5907\u6216\u684c\u9762\u7f51\u7edc\u6d4f\u89c8\u5668\u4e0a\u6253\u5f00\u8be5\u94fe\u63a5\u3002",
    "Sorry, this tweet is protected.  Only confirmed followers have access to %{name}'s Tweets and complete profile.": "\u5bf9\u4e0d\u8d77,\u6b64\u63a8\u6587\u5df2\u88ab\u4fdd\u62a4\u3002\u53ea\u6709\u7ecf\u8fc7 %{name} \u786e\u8ba4\u7684\u5173\u6ce8\u8005\u624d\u80fd\u67e5\u770b\u5176\u63a8\u6587\u548c\u5b8c\u6574\u4e2a\u4eba\u8d44\u6599\u3002",
    "Sorry, we are not able to include all users \u0026 tweets in search results.": "\u62b1\u6b49, \u6211\u4eec\u65e0\u6cd5\u5728\u641c\u7d22\u7ed3\u679c\u4e2d\u5305\u542b\u6240\u6709\u7528\u6237\u53ca\u63a8\u6587\u3002",
    "Sorry, we can't activate your phone.": "\u62b1\u6b49\uff0c\u6211\u4eec\u65e0\u6cd5\u6fc0\u6d3b\u4f60\u7684\u624b\u673a\u3002",
    "Sorry, we can't find that account.": "\u5bf9\u4e0d\u8d77\uff0c\u6211\u4eec\u65e0\u6cd5\u627e\u5230\u8be5\u8d26\u53f7\u3002",
    "Sorry, we couldn't find any representatives for that Zip Code.": "\u5bf9\u4e0d\u8d77,\u6211\u4eec\u627e\u4e0d\u5230\u4efb\u4f55\u8be5\u90ae\u7f16\u4e0b\u7684\u8bae\u5458\u3002",
    "Sorry, we couldn't find that user.": "\u5bf9\u4e0d\u8d77,\u6211\u4eec\u65e0\u6cd5\u627e\u5230\u8be5\u7528\u6237\u3002",
    "Sorry, we couldn't find that!": "\u5bf9\u4e0d\u8d77,\u6211\u4eec\u627e\u4e0d\u5230\u8be5\u5185\u5bb9!",
    "Sorry, we couldn't find your device!": "\u5bf9\u4e0d\u8d77,\u6211\u4eec\u627e\u4e0d\u5230\u4f60\u7684\u8bbe\u5907!",
