    "Sorry, we couldn't verify that you requested an account restoration.": "\u5bf9\u4e0d\u8d77,\u6211\u4eec\u65e0\u6cd5\u786e\u8ba4\u4f60\u6062\u590d\u8d26\u53f7\u7684\u8bf7\u6c42\u3002",
    "Sorry, we don't have a connection to your carrier yet!": "\u62b1\u6b49,\u6211\u4eec\u5c1a\u672a\u80fd\u4e0e\u4f60\u7684\u8fd0\u8425\u5546\u5efa\u7acb\u8fde\u63a5!",
    "Sorry, we were unable to complete your action. Please try again later.": "\u62b1\u6b49, \u6211\u4eec\u65e0\u6cd5\u5b8c\u6210\u4f60\u7684\u64cd\u4f5c\u3002\u8bf7\u7a0d\u5019\u518d\u8bd5\u3002",
    "Sorry, we were unable to subscribe you to the daily digest emails.": "\u5bf9\u4e0d\u8d77\uff0c\u6211\u4eec\u65e0\u6cd5\u4e3a\u4f60\u8ba2\u9605\u6bcf\u65e5\u6458\u8981\u90ae\u4ef6\u3002",
    "Sorry, we were unable to unsubscribe you from email notifications.": "\u5bf9\u4e0d\u8d77\uff0c\u6211\u4eec\u65e0\u6cd5\u53d6\u6d88\u4f60\u8ba2\u9605\u7684\u90ae\u4ef6\u901a\u77e5\u3002",
    "Sorry, we were unable to unsubscribe you from email notifications. Please log in and edit your notification settings.": "\u5bf9\u4e0d\u8d77\uff0c\u6211\u4eec\u65e0\u6cd5\u53d6\u6d88\u4f60\u8ba2\u9605\u7684\u90ae\u4ef6\u901a\u77e5\u3002\u8bf7\u767b\u5f55\u540e\u518d\u4fee\u6539\u63a8\u9001\u901a\u77e5\u3002",
    "Sorry, we were unable to unsubscribe you from the daily digest emails.": "\u5bf9\u4e0d\u8d77\uff0c\u6211\u4eec\u65e0\u6cd5\u53d6\u6d88\u4f60\u8ba2\u9605\u7684\u6bcf\u65e5\u6458\u8981\u90ae\u4ef6\u3002",
    "Sorry, we weren't able to load your contacts": "\u62b1\u6b49, \u6211\u4eec\u65e0\u6cd5\u52a0\u8f7d\u4f60\u7684\u8054\u7cfb\u4eba\u3002",
    "Sorry, we weren\u2019t able to update your profile. Try again or \u003Ca class=\"js-skip-link\" href=\"#\"\u003Eskip this step\u003C/a\u003E.": "\u62b1\u6b49,\u6211\u4eec\u65e0\u6cd5\u66f4\u65b0\u4f60\u7684\u4e2a\u4eba\u8d44\u6599\u3002\u91cd\u8bd5\u6216\u003Ca class=\"js-skip-link\" href=\"#\"\u003E\u8df3\u8fc7\u8fd9\u4e00\u6b65\u003C/a\u003E\u3002",
