    "Twitter connects businesses to customers in real time\u2014and businesses use Twitter to quickly share information with people interested in their products and services, gather real-time market intelligence and feedback, and build relationships with customers, partners and influencers. From brand lift to CRM to direct sales, Twitter offers businesses an easy way to reach an engaged audience. Visit \u003Ca href=\"http://business.twitter.com/\"\u003ETwitter 101 for Businesses\u003C/a\u003E to learn more.": "Twitter \u4f7f\u5546\u4e1a\u7528\u6237\u4e0e\u5ba2\u6237\u5b9e\u65f6\u8fde\u63a5 \u2014\u2014 \u5546\u4e1a\u7528\u6237\u7528 Twitter \u4e0e\u5bf9\u4ed6\u4eec\u7684\u4ea7\u54c1\u611f\u5174\u8da3\u7684\u7528\u6237\u5373\u65f6\u5206\u4eab\u4fe1\u606f\uff0c\u6536\u96c6\u5b9e\u65f6\u5e02\u573a\u53cd\u9988\uff0c\u5e76\u4e0e\u5ba2\u6237\u3001\u5408\u4f5c\u4f19\u4f34\u53ca\u6709\u5f71\u54cd\u529b\u7684\u7fa4\u4f53\u5efa\u7acb\u5173\u7cfb\u3002\u4ece\u54c1\u724c\u4ef7\u503c\u63d0\u5347\u5230\u5ba2\u6237\u5173\u7cfb\u7ba1\u7406\u518d\u5230\u76f4\u9500\uff0cTwitter \u4e3a\u5546\u4e1a\u7528\u6237\u63d0\u4f9b\u4e86\u76f4\u63a5\u8054\u7cfb\u53d7\u4f17\u7684\u65b9\u6cd5\u3002\u8bbf\u95ee \u003Ca href=\"http://business.twitter.com/\"\u003ETwitter \u5546\u4e1a\u7528\u6237\u6307\u5357\u003C/a\u003E\u4ee5\u4e86\u89e3\u66f4\u591a\u3002",
    "Twitter connects people with the things they care about, and now we\u2019ve made them even easier to find. Check out our suggestions for you based on websites you\u2019ve recently visited that have Twitter buttons or widgets.": "Twitter \u5c06\u6709\u5171\u540c\u7231\u597d\u7684\u4eba\u4eec\u8054\u7cfb\u5728\u4e00\u8d77,\u8ba9\u4f60\u66f4\u5bb9\u6613\u627e\u5230\u4ed6\u4eec\u3002\u770b\u770b\u6211\u4eec\u63a8\u8350\u7ed9\u4f60\u7684\u7528\u6237,\u57fa\u4e8e\u4f60\u8bbf\u95ee\u8fc7\u7684\u5e26\u6709 Twitter \u6309\u94ae\u6216\u5c0f\u5de5\u5177\u7684\u7f51\u7ad9\u3002",
    "Twitter connects you with everything you want to know, right now. Short bursts of information are readily available from news organizations, corporate entities, politicians, celebrities, local businesses - even your close friends and family. Also, if you have something to share with the world, Twitter makes it super easy. To join for free, click the link below.": "\u73b0\u5728,Twitter \u628a\u6240\u6709\u4f60\u60f3\u4e86\u89e3\u7684\u4fe1\u606f\u63a8\u9001\u7ed9\u4f60\u3002\u6765\u81ea\u65b0\u95fb,\u7ec4\u7ec7,\u4f01\u4e1a,\u653f\u5ba2,\u540d\u4eba,\u672c\u5730\u5546\u6237,\u751a\u81f3\u4f60\u4eb2\u8fd1\u7684\u670b\u53cb\u548c\u5bb6\u4eba\u53d1\u5e03\u7684\u7b80\u77ed\u4fe1\u606f\u553e\u624b\u53ef\u5f97\u3002\u540c\u6837\u7684,\u5982\u679c\u4f60\u60f3\u4e0e\u8fd9\u4e2a\u4e16\u754c\u5206\u4eab\u4f60\u7684\u4fe1\u606f,Twitter \u8ba9\u8fd9\u53d8\u5f97\u975e\u5e38\u5bb9\u6613\u3002\u70b9\u51fb\u4e0b\u9762\u7684\u94fe\u63a5\u514d\u8d39\u52a0\u5165\u5427\u3002",
    "Twitter delivers instant updates on what\u2019s happening around the world. Sign up today and follow your interests!": "Twitter \u5411\u4f60\u63d0\u4f9b\u5168\u4e16\u754c\u7684\u65b0\u9c9c\u4e8b\u3002\u73b0\u5728\u5c31\u6ce8\u518c,\u5173\u6ce8\u4f60\u611f\u5174\u8da3\u7684\u5185\u5bb9\u5427!",
    "Twitter does not charge for this service.  Standard message and data rates may apply.": "Twitter \u4e0d\u4f1a\u6536\u53d6\u670d\u52a1\u8d39\u7528\u3002\u8fd0\u8425\u5546\u53ef\u80fd\u4f1a\u6536\u53d6\u666e\u901a\u77ed\u4fe1\u53ca\u6570\u636e\u6d41\u91cf\u8d39\u7528\u3002",
    "Twitter does not charge for this service. Standard message and data rates may apply.": "Twitter \u4e0d\u4f1a\u6536\u53d6\u670d\u52a1\u8d39\u7528\u3002\u8fd0\u8425\u5546\u53ef\u80fd\u4f1a\u6536\u53d6\u666e\u901a\u77ed\u4fe1\u53ca\u6570\u636e\u6d41\u91cf\u8d39\u7528\u3002",
    "Twitter does not disclose personally identifying information to third parties except in accordance with our Privacy Policy.": "\u9664\u9690\u79c1\u653f\u7b56\u4e2d\u89c4\u5b9a\u7684\u4f8b\u5916\u60c5\u51b5\u5916,Twitter \u4e0d\u4f1a\u5c06\u4f60\u7684\u4e2a\u4eba\u8eab\u4efd\u6cc4\u9732\u7ed9\u7b2c\u4e09\u65b9\u3002",
    "Twitter doesn't just hire great engineers, it hires great people. It goes without saying you'll work with amazing engineers; the real joy is working with people who are hilarious, fantastically interesting, and generous with their time and teaching.": "Twitter \u4e0d\u4ec5\u8058\u7528\u4f18\u79c0\u7684\u5de5\u7a0b\u5e08,\u8fd8\u9752\u7750\u6770\u51fa\u7684\u4eba\u624d\u3002\u6beb\u65e0\u7591\u95ee,\u4f60\u5c06\u4e0e\u4ee4\u4eba\u60ca\u53f9\u7684\u5de5\u7a0b\u5e08\u4eec\u4e00\u8d77\u5de5\u4f5c,\u771f\u6b63\u7684\u5feb\u4e50\u5728\u4e8e,\u4ed6\u4eec\u975e\u5e38\u7684\u98ce\u8da3,\u5e76\u7ed9\u4e88\u4f60\u5b5c\u5b5c\u4e0d\u5026\u7684\u6307\u5bfc\u3002",
    "Twitter doesn\u2019t charge for this service, but standard message and data rates may apply.": "Twitter \u4e0d\u4f1a\u6536\u53d6\u670d\u52a1\u8d39\u7528\u3002\u8fd0\u8425\u5546\u53ef\u80fd\u4f1a\u6536\u53d6\u666e\u901a\u77ed\u4fe1\u53ca\u6570\u636e\u6d41\u91cf\u8d39\u7528\u3002",
