    "Twitter for SMS is an instant infrastructure for mobile communications. Individuals, businesses and social causes can use Twitter for SMS and our \u003Ca href=\"http://blog.twitter.com/2010/08/introducing-fast-follow-and-other-sms.html\"\u003EFast Follow\u003C/a\u003E program to connect directly to anyone with a mobile phone. Here\u2019s a \u003Ca href=\"http://support.twitter.com/articles/14226-how-to-find-your-twitter-short-long-code\"\u003Elist of all the countries\u003C/a\u003E that offer Twitter for SMS; we are actively working to add even more.": "Twitter \u77ed\u4fe1\u670d\u52a1\u662f\u57fa\u4e8e\u79fb\u52a8\u901a\u4fe1\u7684\u5373\u65f6\u5e94\u7528\u3002\u4e2a\u4eba\u3001\u4f01\u4e1a\u548c\u793e\u4f1a\u56e2\u4f53\uff0c\u53ef\u4ee5\u4f7f\u7528 Twitter \u77ed\u4fe1\u7248\u548c\u6211\u4eec\u7684\u003Ca href=\"http://blog.twitter.com/2010/08/introducing-fast-follow-and-other-sms.html\"\u003E\u5feb\u901f\u5173\u6ce8\u003C/a\u003E\u7a0b\u5e8f\u4e0e\u4efb\u4f55\u624b\u673a\u7528\u6237\u8054\u7cfb\u3002\u8fd9\u91cc\u6709\u652f\u6301 Twitter \u77ed\u4fe1\u7684\u003Ca href=\"http://support.twitter.com/articles/14226-how-to-find-your-twitter-short-long-code\"\u003E\u6240\u6709\u56fd\u5bb6\u5217\u8868\u003C/a\u003E; \u6211\u4eec\u6b63\u52aa\u529b\u5728\u66f4\u591a\u56fd\u5bb6\u63d0\u4f9b\u8be5\u670d\u52a1\u3002",
