    "Twitter gives you a personal, worldwide, royalty-free, non-assignable and non-exclusive license to use the software that is provided to you by Twitter as part of the Services. This license is for the sole purpose of enabling you to use and enjoy the benefit of the Services as provided by Twitter, in the manner permitted by these Terms.": "\u4f5c\u4e3a Twitter \u7684\u670d\u52a1\u7684\u4e00\u90e8\u5206,Twitter \u5c06\u7ed9\u4f60\u4e00\u4e2a\u4e2a\u4eba\u5316\u7684\u3001\u5168\u7403\u7684\u3001\u514d\u7248\u7a0e\u7684\u3001\u4e0d\u53ef\u8f6c\u8ba9\u548c\u975e\u6392\u4ed6\u6027\u7684\u8f6f\u4ef6\u4f7f\u7528\u534f\u8bae\u3002\u8fd9\u4e2a\u534f\u8bae\u552f\u4e00\u7684\u76ee\u7684\u5c31\u662f\u8ba9\u4f60\u5728\u4f7f\u7528\u89c4\u5219\u4e0b\u5c3d\u53ef\u80fd\u81ea\u7531\u800c\u6109\u5feb\u5730\u4f7f\u7528\u5e76\u83b7\u76ca\u3002",
