    "Twitter has an evolving set of %{api_rules_url} for how API developers can interact with your content. These rules exist to enable an open ecosystem with your rights in mind.": "Twitter  \u6709\u4e00\u5957\u4e0d\u65ad\u5b8c\u5584\u7684 %{api_rules_url} \u4ee5\u89c4\u5b9a API \u5f00\u53d1\u8005\u5982\u4f55\u4f7f\u7528\u4f60\u7684\u5185\u5bb9\u3002\u8fd9\u4e9b\u6784\u6210\u4e86\u5f00\u653e\u7684\u751f\u6001\u7cfb\u7edf\u3002",
    "Twitter has received a request to change your account's email address": "Twitter \u5df2\u6536\u5230\u4f60\u4fee\u6539\u8d26\u53f7\u90ae\u4ef6\u5730\u5740\u7684\u8bf7\u6c42\u3002",
    "Twitter has removed the email address \"{{email}}\" from your account (\u003Ca href=\"/{{screen_name}}\"\u003E@{{screen_name}}\u003C/a\u003E), by request of the email owner.": "\u5728\u90ae\u7bb1\u6240\u6709\u8005\u7684\u8981\u6c42\u4e0b\uff0cTwitter \u5df2\u5c06 \"{{email}}\" \u4ece\u4f60\u7684\u8d26\u53f7 (\u003Ca href=\"/{{screen_name}}\"\u003E@{{screen_name}}\u003C/a\u003E) \u79fb\u9664\u3002",
