    "Twitter has reset your account password, @%{screen_name}": "Twitter \u5df2\u7ecf\u91cd\u7f6e\u4e86\u4f60\u7684\u8d26\u53f7\u5bc6\u7801\uff0c@%{screen_name}",
    "Twitter has sent an email to \u003Cstrong\u003E{{email}}\u003C/strong\u003E to verify your email address. You must \u003Cstrong\u003Eclick the link in the email\u003C/strong\u003E in order to verify your address and finish signing up on Twitter.": "\u6211\u4eec\u5df2\u53d1\u9001\u4e86\u4e00\u5c01\u786e\u8ba4\u90ae\u4ef6\u5230 \u003Cstrong\u003E{{email}}\u003C/strong\u003E\u3002\u4f60\u9700\u8981\u003Cstrong\u003E\u70b9\u51fb\u6536\u5230\u7684\u90ae\u4ef6\u4e2d\u7684\u94fe\u63a5\u003C/strong\u003E\u4ee5\u5b8c\u6210\u6ce8\u518c\u3002",
