    "Twitter is a rich source of instantly updated information. It's easy to stay updated on an incredibly wide variety of topics. \u003Cstrong\u003E\u003Ca href='%{signup_url}'\u003EJoin today\u003C/a\u003E\u003C/strong\u003E and \u003Cstrong\u003Efollow @%{user_name}\u003C/strong\u003E.": "Twitter \u662f\u4e00\u4e2a\u4e30\u5bcc\u7684\u5b9e\u65f6\u6d88\u606f\u6765\u6e90\u3002\u4f60\u53ef\u4ee5\u5f88\u5bb9\u6613\u5730\u83b7\u77e5\u5404\u79cd\u4e0d\u540c\u8bdd\u9898\u7684\u6700\u65b0\u6d88\u606f\u3002\u003Cstrong\u003E\u003Ca href='%{signup_url}'\u003E\u73b0\u5728\u5c31\u52a0\u5165\u003C/a\u003E\u003C/strong\u003E\u5e76\u003Cstrong\u003E\u5173\u6ce8 @%{user_name}\u003C/strong\u003E\u3002",
