    "Twitter is translated through our \u003Ca href=\"http://translate.twttr.com\"\u003ETranslator Center\u003C/a\u003E by a vibrant community of volunteers from all over the world. These growing group of upwards from 350,000 passionate users has proven to be indispensable in our efforts to make Twitter available to everyone in the world. With their help, we have been able to launch Twitter in %{languages}.": "\u6765\u81ea\u4e16\u754c\u5404\u5730\u7684\u5fd7\u613f\u8005\u7ec4\u6210\u7684\u793e\u533a\u901a\u8fc7\u6211\u4eec\u7684\u003Ca href=\"http://translate.twttr.com\"\u003E\u7ffb\u8bd1\u4e2d\u5fc3\u003C/a\u003E\u7ffb\u8bd1\u4e86 Twitter\u3002\u8d85\u8fc7 350,000 \u540d\u5bcc\u6709\u6fc0\u60c5\u7684\u7528\u6237\u7ec4\u6210\u7684\u9010\u6e10\u58ee\u5927\u7684\u56e2\u961f\u5df2\u7ecf\u6210\u4e3a Twitter \u5728\u5168\u4e16\u754c\u63a8\u5e7f\u4e0d\u53ef\u6216\u7f3a\u7684\u529b\u91cf\u3002\u5728\u4ed6\u4eec\u7684\u5e2e\u52a9\u4e0b, \u6211\u4eec\u63a8\u51fa\u4e86%{languages}\u7248\u672c\u7684 Twitter\u3002",
    "Twitter is translated through our \u003Ca href=\"https://translate.twitter.com\"\u003ETranslator Center\u003C/a\u003E by a vibrant community of volunteers from all over the world. These growing group of upwards from 350,000 passionate users has proven to be indispensable in our efforts to make Twitter available to everyone in the world. With their help, we have been able to launch Twitter in %{languages}.": "\u6765\u81ea\u4e16\u754c\u5404\u5730\u7684\u5fd7\u613f\u8005\u7ec4\u6210\u7684\u793e\u533a\u901a\u8fc7\u6211\u4eec\u7684\u003Ca href=\"https://translate.twitter.com\"\u003E\u7ffb\u8bd1\u4e2d\u5fc3\u003C/a\u003E\u7ffb\u8bd1\u4e86 Twitter\u3002\u8d85\u8fc7 350,000 \u540d\u5bcc\u6709\u6fc0\u60c5\u7684\u7528\u6237\u7ec4\u6210\u7684\u9010\u6e10\u58ee\u5927\u7684\u56e2\u961f\u5df2\u7ecf\u6210\u4e3a Twitter \u5728\u5168\u4e16\u754c\u63a8\u5e7f\u4e0d\u53ef\u6216\u7f3a\u7684\u529b\u91cf\u3002\u5728\u4ed6\u4eec\u7684\u5e2e\u52a9\u4e0b\uff0c\u6211\u4eec\u63a8\u51fa\u4e86%{languages}\u7248\u672c\u7684 Twitter\u3002",
    "Twitter is waiting for you to send your verification code...": "Twitter \u6b63\u5728\u7b49\u5f85\u4f60\u53d1\u9001\u9a8c\u8bc1\u7801...",
