    "Twitter received a request to reset the password for your Twitter account (%{screen_name}).": "Twitter \u6536\u5230\u4e86\u91cd\u7f6e\u4f60 Twitter \u8d26\u53f7 (%{screen_name}) \u5bc6\u7801\u7684\u8bf7\u6c42\u3002",
    "Twitter respects the intellectual property rights of others and expects users of the Services to do the same.  We will respond to notices of alleged copyright infringement that comply with applicable law and are properly provided to us.  If you believe that your Content has been copied in a way that constitutes copyright infringement, please provide us with the following information: (i) a physical or electronic signature of the copyright owner or a person authorized to act on their behalf; (ii) identification of the copyrighted work claimed to have been infringed; (iii) identification of the material that is claimed to be infringing or to be the subject of infringing activity and that is to be removed or access to which is to be disabled, and information reasonably sufficient to permit us to locate the material; (iv) your contact information, including your address, telephone number, and an email address; (v) a statement by you that you have a good faith belief that use of the material in the manner complained of is not authorized by the copyright owner, its agent, or the law; and (vi) a statement that the information in the notification is accurate, and, under penalty of perjury, that you are authorized to act on behalf of the copyright owner.": "Twitter \u5c0a\u91cd\u4ed6\u4eba\u7684\u77e5\u8bc6\u4ea7\u6743,\u4eab\u53d7 Twitter \u670d\u52a1\u7684\u7528\u6237\u4e5f\u6709\u4e49\u52a1\u8fd9\u6837\u505a\u3002\u6211\u4eec\u5c06\u6d89\u5acc\u4fb5\u6743\u7684\u901a\u77e5,\u9075\u5b88\u9002\u7528\u6cd5\u5f8b,\u6b63\u786e\u5730\u63d0\u4f9b\u7ed9\u6211\u4eec\u53cd\u9988\u3002\u5982\u679c\u4f60\u8ba4\u4e3a\u4f60\u7684\u5185\u5bb9\u5df2\u7ecf\u590d\u5236\u7684\u65b9\u5f0f\u6784\u6210\u7248\u6743\u4fb5\u6743,\u8bf7\u63d0\u4f9b\u4ee5\u4e0b\u4fe1\u606f: (i) \u7269\u7406\u6216\u7535\u5b50\u7b7e\u540d\u7684\u7248\u6743\u62e5\u6709\u4eba\u6216\u6388\u6743\u4ee5\u5176\u540d\u4e49\u884c\u4e8b\u7684\u7684\u4eba;(ii) \u8bc6\u522b\u58f0\u79f0\u88ab\u4fb5\u6743\u7684\u7248\u6743\u4f5c\u54c1;(iii) \u9274\u5b9a\u7684\u58f0\u79f0\u88ab\u4fb5\u6743\u6216\u4fb5\u6743\u6d3b\u52a8\u7684\u4e3b\u9898,\u8fd9\u662f\u88ab\u5220\u9664\u6216\u5b83\u662f\u88ab\u7981\u7528\u7684\u8bbf\u95ee\u7684\u6750\u6599\u548c\u4fe1\u606f\u5408\u7406\u8db3\u4ee5\u8ba9\u6211\u4eec\u627e\u5230\u7684\u6750\u6599;(iv) \u4f60\u7684\u8054\u7cfb\u4fe1\u606f,\u5305\u62ec\u4f60\u7684\u5730\u5740\u3001\u7535\u8bdd\u53f7\u7801\u3001\u7535\u5b50\u90ae\u4ef6\u5730\u5740;(v) \u7531\u4f60\u7684\u4e00\u4efd\u58f0\u660e\u4e2d\u8bf4\u4f60\u6709\u5145\u5206\u7684\u7406\u7531\u76f8\u4fe1,\u4f7f\u7528\u7684\u6750\u6599\u7684\u65b9\u5f0f\u6295\u8bc9\u5e76\u975e\u7531\u7248\u6743\u62e5\u6709\u8005,\u5176\u4ee3\u7406\u4eba\u6216\u6cd5\u5f8b;\u53ca (vi) \u4e00\u4efd\u58f0\u660e,\u901a\u77e5\u4e2d\u7684\u4fe1\u606f\u662f\u51c6\u786e\u7684,\u5e76\u6839\u636e\u4f2a\u8bc1\u5904\u7f5a,\u6388\u6743,\u4f60\u88ab\u6388\u6743\u4ee3\u8868\u7248\u6743\u884c\u4e3a\u6240\u6709\u8005\u3002",
    "Twitter send a verification email to your Keitai.": "Twitter \u53d1\u9001\u4e00\u5c01\u9a8c\u8bc1\u90ae\u4ef6\u5230\u4f60\u7684\u624b\u673a\u3002",
