    "Twitter use in media (TV, sports, journalism, music)": "\u4f20\u5a92 (\u7535\u89c6\u3001\u4f53\u80b2\u3001\u65b0\u95fb\u3001\u97f3\u4e50\u7b49) \u4e2d\u7684 Twitter \u4f7f\u7528",
    "Twitter verifies accounts, by adding a badge to their profile, to help our users find notable people and brands.": "Twitter \u901a\u8fc7\u5bf9\u8ba4\u8bc1\u8d26\u53f7\u6dfb\u52a0\u5b9e\u540d\u5fbd\u7ae0\u6765\u5e2e\u52a9\u4eba\u4eec\u627e\u5230\u77e5\u540d\u4eba\u7269\u53ca\u54c1\u724c\u3002",
    "Twitter was founded  in San Francisco, but it's used by people in nearly every country in the world. The service is available in more than 20 languages, and we continue to add them. You can change your \u003Ca href=\"http://support.twitter.com/groups/31-twitter-basics/topics/107-my-profile-account-settings/articles/119137-how-to-change-language-settings\"\u003Elanguage preference\u003C/a\u003E in your user settings with just a few clicks.": "Twitter \u521b\u7acb\u4e8e\u65e7\u91d1\u5c71\uff0c\u4f46\u7528\u6237\u904d\u5e03\u5168\u7403\u51e0\u4e4e\u6bcf\u4e2a\u56fd\u5bb6\u3002\u5176\u670d\u52a1\u73b0\u5df2\u63d0\u4f9b\u8d85\u8fc7 20 \u79cd\u8bed\u8a00\uff0c\u5e76\u8fd8\u5728\u4e0d\u65ad\u589e\u52a0\u3002\u53ea\u9700\u51e0\u6b21\u70b9\u51fb\u5373\u53ef\u5728\u7528\u6237\u8bbe\u7f6e\u4e2d\u66f4\u6539\u003Ca href=\"http://support.twitter.com/groups/31-twitter-basics/topics/107-my-profile-account-settings/articles/119137-how-to-change-language-settings\"\u003E\u8bed\u8a00\u9996\u9009\u9879\u003C/a\u003E\u3002",
    "Twitter will never ask you to log in to a webpage to prove that you're not a spammer, nor will we ever request your password for any reason. If you receive emails asking you to log into Twitter, please always check that the address or URL bar in your web browser is at http://twitter.com/ or http://twitter.com/login before filling in your username or password to prevent unscrupulous parties from stealing your login info.": "Twitter \u6c38\u8fdc\u4e0d\u4f1a\u8981\u6c42\u4f60\u767b\u5f55\u8fdb\u5165\u4e00\u4e2a\u7f51\u9875\u6765\u8bc1\u660e\u4f60\u6ca1\u6709\u53d1\u9001\u5783\u573e\u4fe1\u606f,\u6211\u4eec\u4e5f\u7edd\u4e0d\u4f1a\u56e0\u4e3a\u4efb\u4f55\u539f\u56e0\u8981\u6c42\u4f60\u63d0\u4f9b\u5bc6\u7801\u3002\u5982\u679c\u4f60\u6536\u5230\u7535\u5b50\u90ae\u4ef6\u8981\u6c42\u4f60\u767b\u5f55 Twitter,\u8bf7\u5728\u8f93\u5165\u4f60\u7684\u7528\u6237\u540d\u548c\u5bc6\u7801\u4e4b\u524d\u52a1\u5fc5\u68c0\u67e5\u786e\u8ba4\u5176\u5730\u5740\u6216\u8005\u4f60\u7684\u6d4f\u89c8\u5668\u7684\u7f51\u7ad9\u680f\u662f\u4f4d\u4e8e http://twitter.com \u6216 http://twitter.com/login,\u4ee5\u9632\u6709\u4eba\u6076\u610f\u76d7\u7528\u4f60\u7684\u767b\u5f55\u4fe1\u606f\u3002",
