    "Using Twitter is going to change the way you think about staying in touch with friends and family. Did you know you can send and receive tweets (Twitter updates) via mobile texting or the web? To do that, you'll want to visit your settings page (and you'll want to invite some friends).": "\u4f7f\u7528 Twitter \u6765\u6539\u53d8\u4f60\u4e0e\u670b\u53cb\u548c\u5bb6\u4eba\u7684\u4ea4\u6d41\u65b9\u5f0f\u3002\u4f60\u77e5\u9053\u5417? \u4f60\u53ef\u4ee5\u901a\u8fc7\u624b\u673a\u77ed\u4fe1\u6216\u7f51\u9875\u53d1\u9001\u548c\u63a5\u6536\u63a8\u6587 (Twitter \u4e0a\u7684\u5185\u5bb9\u66f4\u65b0)\u3002\u8981\u4f7f\u7528\u8fd9\u4e9b\u529f\u80fd,\u4f60\u9700\u8981\u8bbf\u95ee\u4f60\u7684\u8bbe\u7f6e\u9875\u9762(\u4f60\u8fd8\u9700\u8981\u9080\u8bf7\u4e00\u4e9b\u597d\u53cb\u52a0\u5165)\u3002",
