    "We've also whitelisted the following IP addresses:": "\u6211\u4eec\u8fd8\u5c06\u4e0b\u8ff0 IP \u5730\u5740\u52a0\u5165\u4e86\u767d\u540d\u5355:",
    "We've found that the people who enjoy Twitter most tend to follow a variety of accounts: friends, family, people in their profession, local shops and events, and most importantly, people who share their passions.": "\u6211\u4eec\u53d1\u73b0,\u4eab\u53d7 Twitter \u7684\u4eba\u6700\u503e\u5411\u4e8e\u5173\u6ce8\u5404\u79cd\u7528\u6237: \u670b\u53cb,\u4eb2\u4eba,\u540c\u4e8b,\u5f53\u5730\u7684\u5546\u5e97\u548c\u4e8b\u4ef6,\u4ee5\u53ca\u6700\u91cd\u8981\u7684,\u5206\u4eab\u4ed6\u4eec\u6fc0\u60c5\u7684\u4eba\u4eec\u3002",
    "We've missed you on Twitter!": "\u6211\u4eec\u5728 Twitter \u4e0a\u975e\u5e38\u60f3\u5ff5\u4f60!",
