    "We've sent a login verification request to the {{client_application_name}} app.": "\u6211\u4eec\u5df2\u7ecf\u5411 {{client_application_name}} \u5e94\u7528\u53d1\u9001\u4e86\u767b\u5f55\u9a8c\u8bc1\u8bf7\u6c42\u3002",
    "We've sent a login verification request to your phone.": "\u6211\u4eec\u5df2\u53d1\u9001\u4e00\u4e2a\u767b\u5f55\u9a8c\u8bc1\u8bf7\u6c42\u5230\u4f60\u7684\u624b\u673a\u3002",
