    "We've tried sending emails to \u003Cstrong\u003E{{current_email}}\u003C/strong\u003E but they are not getting delivered. You will not receive important account emails unless you update your email address.": "\u6211\u4eec\u5df2\u5c1d\u8bd5\u5c06\u786e\u8ba4\u90ae\u4ef6\u53d1\u5f80 \u003Cstrong\u003E{{current_email}}\u003C/strong\u003E\uff0c\u4f46\u672a\u80fd\u6210\u529f\u6295\u9012\u3002\u5728\u66f4\u65b0\u90ae\u4ef6\u5730\u5740\u4e4b\u524d\u4f60\u5c06\u65e0\u6cd5\u6536\u5230\u91cd\u8981\u7684\u8d26\u53f7\u90ae\u4ef6\u3002",
