    "Welcome to the Developer Beta of the Twitter Application Platform! We're just getting started, but we thought we'd start releasing components that will help you, the developers, connect your users with the world, \u003Cstrong\u003Eright now\u003C/strong\u003E.": "\u6b22\u8fce\u6765\u5230 Twitter \u5e94\u7528\u5e73\u53f0\u7684\u5f00\u53d1\u8005 Beta \u7248! \u867d\u7136\u624d\u521a\u521a\u8d77\u6b65, \u4f46\u662f\u6211\u4eec\u4f1a\u9010\u6b65\u5f00\u653e\u6240\u6709\u529f\u80fd, \u8fd9\u5c06\u5e2e\u52a9\u4f60 \u548c\u5176\u4ed6\u5f00\u53d1\u8005\u5e76\u628a\u4f60\u7684\u7528\u6237\u548c\u4e16\u754c\u003Cstrong\u003E\u5373\u65f6\u003C/strong\u003E\u8054\u7cfb\u5728\u4e00\u8d77\u3002",
