    "Which tweet will help double your rate of new followers for the day?": "\u54ea\u6761\u63a8\u6587\u4f1a\u8ba9\u4f60\u6bcf\u65e5\u5173\u6ce8\u8005\u7684\u589e\u52a0\u901f\u5ea6\u7ffb\u500d?",
    "While Twitter is a free service, phone texting on your personal plan might not be. If you choose to use phone texting with Twitter, be sure to check with your provider about associated costs.": "\u867d\u7136 Twitter \u662f\u514d\u8d39\u670d\u52a1,\u4f46\u662f\u7528\u624b\u673a\u53d1\u63a8\u53ef\u80fd\u8981\u6536\u8d39\u3002\u5982\u679c\u4f60\u9009\u62e9\u4f7f\u7528 Twitter \u7684\u77ed\u4fe1\u529f\u80fd,\u8bf7\u5411\u4f60\u7684\u624b\u673a\u8fd0\u8425\u5546\u786e\u8ba4\u4f60\u7684\u624b\u673a\u8d39\u7528\u9884\u7b97\u3002",
    "While this suspension is still in place, please do not attempt to register a new API key for your application without authorization from Twitter. Such an action is a violation of our API Terms of Service and may result in the permanent suspension of your application (as well as any associated developer accounts).": "\u505c\u7528\u671f\u95f4,\u8bf7\u4e0d\u8981\u5728\u672a\u7ecf Twitter \u6388\u6743\u7684\u60c5\u51b5\u4e0b\u5c1d\u8bd5\u4e3a\u4f60\u7684\u7a0b\u5e8f\u6ce8\u518c\u4e00\u4e2a\u65b0\u7684 API \u5bc6\u94a5\u3002\u8fd9\u6837\u7684\u884c\u4e3a\u8fdd\u53cd\u6211\u4eec\u7684 API \u670d\u52a1\u6761\u6b3e,\u5e76\u53ef\u80fd\u5bfc\u81f4\u4f60\u7684\u5e94\u7528\u7a0b\u5e8f\u88ab\u6c38\u4e45\u505c\u7528 (\u4ee5\u53ca\u4efb\u4f55\u5173\u8054\u7684\u5f00\u53d1\u8005\u8d26\u53f7)\u3002",
    "While we appreciate your enthusiasm, in order to control abuse, we limit how often you can do this.": "\u5c3d\u7ba1\u6211\u4eec\u8d5e\u8d4f\u4f60\u7684\u70ed\u60c5,\u4f46\u4e3a\u4e86\u63a7\u5236\u6ee5\u7528,\u6211\u4eec\u9650\u5236\u4e86\u4f60\u80fd\u8fdb\u884c\u641c\u7d22\u7684\u9891\u7387\u3002",
    "While we appreciate your enthusiasm, in order to control abuse, we limit how often you can search.": "\u5c3d\u7ba1\u6211\u4eec\u8d5e\u8d4f\u4f60\u7684\u70ed\u60c5,\u4f46\u4e3a\u4e86\u63a7\u5236\u6ee5\u7528,\u6211\u4eec\u9650\u5236\u4e86\u4f60\u80fd\u8fdb\u884c\u641c\u7d22\u7684\u9891\u7387\u3002",
