    "With your newly verified account, you will receive weekly activity reports with information about the number of people following you, and simple tips about how to increase that number.": "\u4f34\u968f\u7740\u4f60\u7684\u8d26\u53f7\u7684\u8ba4\u8bc1\uff0c\u4f60\u5c06\u4f1a\u6536\u5230\u5173\u6ce8\u8005\u6570\u91cf\u7684\u6bcf\u5468\u52a8\u6001\u62a5\u544a\u4ee5\u53ca\u63d0\u9ad8\u5173\u6ce8\u8005\u6570\u91cf\u7684\u7b80\u5355\u5c0f\u6280\u5de7\u3002",
    "With your newly verified account, you will receive weekly activity reports with information about the number of people following you, and simple tips about how to increase that number. Stop getting the report by choosing \"unsubscribe\" in the email footer, or uncheck the box in your email notification settings in your profile settings.": "\u4f34\u968f\u7740\u4f60\u7684\u8d26\u53f7\u7684\u8ba4\u8bc1\uff0c\u4f60\u5c06\u4f1a\u6536\u5230\u5173\u6ce8\u8005\u6570\u91cf\u7684\u6bcf\u5468\u52a8\u6001\u62a5\u544a\u4ee5\u53ca\u63d0\u9ad8\u5173\u6ce8\u8005\u6570\u91cf\u7684\u5c0f\u7a8d\u95e8\u3002\u4f60\u53ef\u4ee5\u5728\u90ae\u4ef6\u9875\u811a\u5904\u9009\u62e9\u201c\u53d6\u6d88\u8ba2\u9605\u201d\u6216\u5728\u4e2a\u4eba\u8bbe\u7f6e\u4e2d\u53d6\u6d88\u90ae\u4ef6\u901a\u77e5\u7684\u590d\u9009\u6846\u4ee5\u505c\u6b62\u9000\u8ba2\u6b64\u62a5\u544a\u3002",
    "With your newly verified account, you will receive weekly reports with information about the number of people following you, and simple tips about how to increase that number. If you wish to stop getting this digest, choose \"unsubscribe\" in an email or change your email notification preference in your profile settings.": "\u4f34\u968f\u7740\u4f60\u7684\u8d26\u53f7\u7684\u8ba4\u8bc1\uff0c\u4f60\u5c06\u4f1a\u6536\u5230\u5305\u542b\u5173\u6ce8\u8005\u6570\u91cf\u4fe1\u606f\u7684\u6bcf\u5468\u62a5\u544a\uff0c\u4ee5\u53ca\u600e\u6837\u63d0\u9ad8\u5173\u6ce8\u8005\u6570\u91cf\u7684\u7b80\u5355\u5c0f\u6280\u5de7\u3002\u5982\u679c\u4f60\u5e0c\u671b\u9000\u8ba2\u672c\u6708\u520a\uff0c\u53ef\u4ee5\u5728\u90ae\u4ef6\u4e2d\u9009\u62e9\u201c\u9000\u8ba2\u201d\u6216\u5728\u4f60\u7684\u4e2a\u4eba\u8d44\u6599\u8bbe\u7f6e\u4e2d\u66f4\u6539\u4f60\u7684\u90ae\u4ef6\u901a\u77e5\u8bbe\u7f6e\u3002",
