    "You agree that this license includes the right for Twitter to make such Content available to other companies, organizations or individuals who partner with Twitter for the syndication, broadcast, distribution or publication of such Content on other media and services, subject to our terms and conditions for such Content use. ": "\u9075\u5faa\u6211\u4eec\u5bf9\u8be5\u7c7b\u201c\u5185\u5bb9\u201d\u4f7f\u7528\u7684\u6761\u6b3e\u4e0e\u6761\u4ef6,\u4f60\u540c\u610f\u8be5\u8bb8\u53ef\u8bc1\u5305\u542b Twitter \u4e4b\u6743\u5229\u4e4b\u63d0\u4f9b\u8be5\u7c7b\u201c\u5185\u5bb9\u201d\u7ed9\u5176\u4ed6\u548c Twitter \u5408\u4f5c\u7684\u516c\u53f8\u3001\u7ec4\u7ec7\u6216\u4e2a\u4eba\u4ee5\u4fc3\u6210\u8be5\u7c7b\u201c\u5185\u5bb9\u201d\u5728\u5176\u5b83\u5a92\u4f53\u548c\u670d\u52a1\u4e0a\u7684\u4f01\u4e1a\u8054\u5408\u7ec4\u7ec7\u5316\u3001\u5e7f\u64ad\u3001\u5206\u53d1\u6216\u51fa\u7248\u3002\n      ",
