    "You are accessing a user's account for support purposes. Please ensure you log out.": "\u6b63\u5728\u4e3a\u63d0\u4f9b\u6280\u672f\u652f\u6301\u800c\u8bbf\u95ee\u5176\u4ed6\u7528\u6237\u7684\u8d26\u53f7\u3002\u8bf7\u8bb0\u5f97\u767b\u51fa\u3002",
