    "You are over the limit for reporting users as spam.": "\u4f60\u8d85\u8fc7\u4e86\u62a5\u544a\u5783\u573e\u4fe1\u606f\u7528\u6237\u7684\u6570\u91cf\u9650\u5236\u3002",
