    "You're looking at a custom timeline made by @{{#curator_view}}{{screen_name}}{{/curator_view}}.\n          Learn how to \u003Ca href=\"{{custom_timeline_help_path}}\" target=\"_blank\"\u003Emake your own\u003C/a\u003E.": "\u4f60\u6b63\u5728\u67e5\u770b @{{#curator_view}}{{screen_name}}{{/curator_view}} \u521b\u5efa\u7684\u7684\u81ea\u5b9a\u4e49\u65f6\u95f4\u7ebf\u3002\u4e86\u89e3\u5982\u4f55\u003Ca href=\"{{custom_timeline_help_path}}\" target=\"_blank\"\u003E\u521b\u5efa\u4f60\u81ea\u5df1\u7684\u81ea\u5b9a\u4e49\u65f6\u95f4\u7ebf\u003C/a\u003E\u3002",
    "You're looking at a custom timeline made by @{{#curator_view}}{{screen_name}}{{/curator_view}}.\n          Learn how to \u003Ca href=\"{{custom_timeline_help_path}}\"\u003Emake your own\u003C/a\u003E.": "\u4f60\u6b63\u5728\u67e5\u770b @{{#curator_view}}{{screen_name}}{{/curator_view}} \u521b\u5efa\u7684\u81ea\u5b9a\u4e49\u65f6\u95f4\u7ebf\u3002\u4e86\u89e3\u003Ca href=\"{{custom_timeline_help_path}}\"\u003E\u5982\u4f55\u5efa\u7acb\u4f60\u81ea\u5df1\u7684\u81ea\u5b9a\u4e49\u65f6\u95f4\u7ebf\u003C/a\u003E\u3002",
    "You're not following %{person}.": "\u4f60\u5c1a\u672a\u5173\u6ce8 %{person}\u3002",
