    "You're trying to follow a user that doesn't exist.": "\u4f60\u5c1d\u8bd5\u5173\u6ce8\u7684\u7528\u6237\u4e0d\u5b58\u5728\u3002",
    "You've allowed the following applications to access your account": "\u4f60\u5df2\u5141\u8bb8\u4ee5\u4e0b\u5e94\u7528\u7a0b\u5e8f\u8bbf\u95ee\u4f60\u7684\u8d26\u53f7",
    "You've already registered this phone number. Please sign in.": "\u4f60\u5df2\u7ecf\u6ce8\u518c\u4e86\u6b64\u624b\u673a\u53f7\u7801\uff0c\u8bf7\u767b\u5f55\u3002",
    "You've already requested to follow %s.": "\u4f60\u5df2\u7ecf\u8bf7\u6c42\u5173\u6ce8 %s\u3002",
    "You've already requested to follow %{person}.": "\u4f60\u5df2\u7ecf\u8bf7\u6c42\u5173\u6ce8 %{person}\u3002",
