    "You've granted access to %{application}!": "\u4f60\u5df2\u7ecf\u6388\u6743\u4e86 %{application}!",
    "You've reached our SMS system limit of 5000 tweets received/day. DMs \u0026 sending Tweets not affected. Read tweets at m.twitter.com (resets in %{hours_before_reset} hours).": "\u4f60\u5df2\u8fbe\u5230\u6211\u4eec\u77ed\u4fe1\u7cfb\u7edf\u6bcf\u5929\u63a5\u6536 5000 \u6761\u63a8\u6587\u7684\u4e0a\u9650\u4e86\u3002\u79c1\u4fe1\u4e0e\u53d1\u9001\u63a8\u6587\u529f\u80fd\u4e0d\u53d7\u5f71\u54cd\u3002\u8bbf\u95ee m.twitter.com \u4ee5\u9605\u8bfb\u63a8\u6587\uff08%{hours_before_reset}\u5c0f\u65f6\u540e\u91cd\u7f6e\uff09\u3002",
    "You've reached our SMS system limit of 5000 tweets received/day. DMs \u0026 sending Tweets not affected. Read tweets at m.twitter.com (resets in an hour).": "\u4f60\u5df2\u8fbe\u5230\u6211\u4eec\u77ed\u4fe1\u7cfb\u7edf\u6bcf\u5929\u63a5\u6536 5000 \u6761\u63a8\u6587\u7684\u4e0a\u9650\u4e86\u3002\u79c1\u4fe1\u4e0e\u53d1\u9001\u63a8\u6587\u529f\u80fd\u4e0d\u53d7\u5f71\u54cd\u3002\u8bbf\u95ee m.twitter.com \u4ee5\u9605\u8bfb\u63a8\u6587\uff081\u5c0f\u65f6\u540e\u91cd\u7f6e\uff09\u3002",
    "You've reached your daily limit for Tweet notifications (resets in %{hours_before_reset} hrs). Reply w/ your full name to create an account and get additional Tweet notifications.": "\u4f60\u5df2\u8fbe\u5230\u6bcf\u65e5\u63a8\u6587\u63d0\u9192\u4e0a\u9650\uff08%{hours_before_reset}\u5c0f\u65f6\u540e\u91cd\u7f6e\uff09\u3002\u56de\u590d\u4f60\u7684\u5168\u540d\u5373\u53ef\u521b\u5efa\u4e00\u4e2a\u8d26\u53f7\u5e76\u63a5\u6536\u989d\u5916\u63a8\u6587\u63d0\u9192\u3002",
    "You've reached your daily limit for Tweet notifications (resets in an hr). Reply w/ your full name to create an account and get additional Tweet notifications.": "\u4f60\u5df2\u8fbe\u5230\u6bcf\u65e5\u63a8\u6587\u63d0\u9192\u4e0a\u9650\uff081\u5c0f\u65f6\u540e\u91cd\u7f6e\uff09\u3002\u56de\u590d\u4f60\u7684\u5168\u540d\u5373\u53ef\u521b\u5efa\u4e00\u4e2a\u8d26\u53f7\u5e76\u63a5\u6536\u989d\u5916\u63a8\u6587\u63d0\u9192\u3002",
    "You've reached your mobile provider's limit of %{mt_limit} tweets received/day. DMs \u0026 sending Tweets not affected. Read tweets at m.twitter.com (resets in %{hours_before_reset} hours).": "\u4f60\u5df2\u8fbe\u5230\u8fd0\u8425\u5546\u8bbe\u7f6e\u7684\u6bcf\u5929\u63a5\u6536 %{mt_limit} \u6761\u63a8\u6587\u7684\u4e0a\u9650\u4e86\u3002\u79c1\u4fe1\u4e0e\u53d1\u9001\u63a8\u6587\u529f\u80fd\u4e0d\u53d7\u5f71\u54cd\u3002\u8bbf\u95ee m.twitter.com \u4ee5\u9605\u8bfb\u63a8\u6587\uff08%{hours_before_reset}\u5c0f\u65f6\u540e\u91cd\u7f6e\uff09\u3002",
    "You've reached your mobile provider's limit of %{mt_limit} tweets received/day. DMs \u0026 sending Tweets not affected. Read tweets at m.twitter.com (resets in an hour).": "\u4f60\u5df2\u8fbe\u5230\u8fd0\u8425\u5546\u8bbe\u5b9a\u7684\u6bcf\u5929\u63a5\u6536 %{mt_limit} \u6761\u63a8\u6587\u7684\u4e0a\u9650\u4e86\u3002\u79c1\u4fe1\u4e0e\u53d1\u9001\u63a8\u6587\u529f\u80fd\u4e0d\u53d7\u5f71\u54cd\u3002\u8bbf\u95ee m.twitter.com \u4ee5\u9605\u8bfb\u63a8\u6587(1\u5c0f\u65f6\u540e\u91cd\u7f6e)\u3002",
    "You've sent a request to follow this person. If your request is approved, you'll be able to view their tweets.": "\u4f60\u5df2\u7ecf\u5411\u6b64\u7528\u6237\u53d1\u9001\u4e86\u5173\u6ce8\u8bf7\u6c42\u3002\u5982\u679c\u4f60\u7684\u8bf7\u6c42\u901a\u8fc7,\u4f60\u5c06\u53ef\u4ee5\u67e5\u770b\u5176\u63a8\u6587\u3002",
