    "Your \u003Ca href=\"{{settings_path}}\" target=\"_blank\"\u003Emedia display settings\u003C/a\u003E are set up to hide photos and videos that might contain sensitive content.": "\u4f60\u7684\u003Ca href=\"{{settings_path}}\" target=\"_blank\"\u003E\u5a92\u4f53\u5185\u5bb9\u663e\u793a\u8bbe\u7f6e\u003C/a\u003E\u9690\u85cf\u4e86\u53ef\u80fd\u5305\u542b\u654f\u611f\u5185\u5bb9\u7684\u56fe\u7247\u6216\u89c6\u9891\u3002",
    "Your \u003Cstrong\u003ETwitter username\u003C/strong\u003E:": "\u4f60\u7684 \u003Cstrong\u003ETwitter \u7528\u6237\u540d\u003C/strong\u003E:",
    "Your \u003Cstrong\u003Eemail address\u003C/strong\u003E or \u003Cstrong\u003ETwitter username\u003C/strong\u003E:": "\u4f60\u7684\u003Cstrong\u003E\u90ae\u4ef6\u5730\u5740\u003C/strong\u003E\u6216 \u003Cstrong\u003ETwitter \u7528\u6237\u540d\u003C/strong\u003E:",
    "Your \u003Cstrong\u003Eemail address\u003C/strong\u003E or \u003Cstrong\u003Ephone number\u003C/strong\u003E:": "\u4f60\u7684\u003Cstrong\u003E\u90ae\u4ef6\u5730\u5740\u003C/strong\u003E\u6216\u003Cstrong\u003E\u624b\u673a\u53f7\u7801\u003C/strong\u003E:",
